INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012619, 'Middle Cambrian', NULL, 'The middle epoch of the Cambrian Period.', NULL, '2007-10-27 00:00:00', NULL, 167916112856012591, 1684);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012620, 'Early Cambrian', NULL, 'The oldest epoch of the Cambrian Period.', NULL, '2007-12-23 00:00:00', NULL, 167916112856012591, 1683);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012621, 'ever-dry', NULL, 'Climate defined for the most part by the total lack of precipitation, where the rate of precipitation is much less than the rate of evapotranspiration.  Modern examples include the Sahara, Arabian and Atacama deserts.', NULL, '2007-12-23 00:00:00', NULL, 167916112856012524, 880);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012622, 'dry', NULL, 'Climate defined by little seasonal precipitation where the rate of precipitation is less than the rate of evapotranspiration; examples include the fringes of deserts, wet deserts associated with fog and semideserts.', NULL, '2007-12-23 00:00:00', NULL, 167916112856012524, 879);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012623, 'wet-dry', NULL, 'Climate defined by seasonal distribution of precipitation, where the rate of precipitation is broadly equal to the rate of evapotranspiration; common for localities with savannah, grassland, steppes and mixed savannah-woodland.', NULL, '2007-12-23 00:00:00', NULL, 167916112856012524, 878);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012624, 'wet', NULL, 'Climate defined by abundant seasonal to annual precipitation where the rate of precipitation is greater than the rate of evapotranspiration; common for areas of closed canopy forest.', NULL, '2007-12-23 00:00:00', NULL, 167916112856012524, 877);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012625, 'ever-wet', NULL, 'Climate defined by abundant precipitation and available water throughout the year, where the rate of precipitation is much greater than the rate of evapotranspiration; common for areas of dense rainforest and swamps, for example the Amazon and parts of Indonesia and Malaysia.', NULL, '2007-12-23 00:00:00', NULL, 167916112856012524, 876);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193464, 'alluvium', NULL, 'Material deposited by the action of a stream or river.', 'fluvium;alluvial deposit;fluvial deposit', '2008-05-30 00:00:00', NULL, 1677736971154193633, 1567);
