INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012631, 'terrestrial', NULL, 'Formed on land, ie. from somewhat above the high tide line through to far away from the sea.', 'non-marine', '2007-11-24 00:00:00', NULL, 167916112856012566, 870);
