INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012638, 'gravity response', NULL, 'A measurement of the gravitational field at or over an area of interest.', NULL, '2008-01-11 00:00:00', NULL, 167916112856012519, 987);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012639, 'batholith [morphology]', NULL, 'A large, generally discordant plutonic body with an areal extent greater than or equal to 100 km2 and no known floor.', NULL, '2008-01-11 00:00:00', NULL, 167916112856012582, 986);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012640, 'vein', NULL, 'An epigenetic mineral filling of a fault or fracture in a host rock, in tabular or sheetlike form, often with associated host rock replacement.', NULL, '2008-01-11 00:00:00', NULL, 167916112856012582, 985);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012641, 'wedge', NULL, 'A wedge-shaped body; thicker on one side.', 'clastic wedge', '2008-01-11 00:00:00', NULL, 167916112856012582, 984);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012910, 'cgs(=x10-6)', 'cgs(=x10-6)', NULL, NULL, '2007-11-23 00:00:00', NULL, 167916112856012590, 856);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012642, 'veneer', NULL, 'A thin but extensive layer of sedimentary material covering an older geological formation or surface.', NULL, '2008-01-11 00:00:00', NULL, 167916112856012582, 983);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012643, 'trough', NULL, 'The shape of a body of sedimentary material deposited in an elongate depression.', NULL, '2008-01-11 00:00:00', NULL, 167916112856012582, 982);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012644, 'tabular', NULL, 'A body with a ratio of width to thickness of greater than 50 to 1 but less than 1000 to 1.', NULL, '2008-01-11 00:00:00', NULL, 167916112856012582, 981);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012645, 'sag', NULL, 'A broad, shallow structural basin with gently sloping sides.', NULL, '2008-01-11 00:00:00', NULL, 167916112856012582, 980);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012646, 'rift', NULL, 'A long, narrow continental trough bounded by normal faults; a graben of regional extent.', NULL, '2008-01-11 00:00:00', NULL, 167916112856012582, 979);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012647, 'ribbon', NULL, 'A body that is ribbon like, in that it is thin and long in one horizontal direction, and narrow in a perpendicular direction.', 'shoestring', '2008-01-11 00:00:00', NULL, 167916112856012582, 978);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012648, 'pull-apart basin', NULL, 'A topographic depression centred over an extensional bend or extensional step-over in a strike slip fault.', NULL, '2008-01-11 00:00:00', NULL, 167916112856012582, 977);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012649, 'prism', NULL, 'A long, narrow, wedged-shaped sedimentary body whose width to thickness ratio is greater than 5 to 1 but less than 50 to 1.', NULL, '2008-01-11 00:00:00', NULL, 167916112856012582, 976);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012650, 'pod', NULL, 'A small, elongate lenticular or rodlike shaped body.', NULL, '2008-01-11 00:00:00', NULL, 167916112856012582, 975);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012651, 'pillow', NULL, 'A bun-shaped mass, resembling the size and shape of a pillow.', NULL, '2008-01-11 00:00:00', NULL, 167916112856012582, 974);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012652, 'mound', NULL, 'A lens-like body of rock with a lateral extent less than 100m, generally flat at teh bottom, with stratigraphic pinch out of beds along the upper sides.', NULL, '2008-01-11 00:00:00', NULL, 167916112856012582, 973);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012653, 'lens', NULL, 'A body bounded by converging surfaces, at least one of which is curved, thick in the middle and thinning towards the edges.', NULL, '2008-01-11 00:00:00', NULL, 167916112856012582, 972);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012654, 'layer', NULL, 'A tabular rock body occuring between other rock bodies.', NULL, '2008-01-11 00:00:00', NULL, 167916112856012582, 971);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012655, 'irregular', NULL, 'A rock body whose geometry is irregular and cannot be characterized using the available terminology.', NULL, '2008-01-11 00:00:00', NULL, 167916112856012582, 970);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012656, 'intrusion [morphology]', NULL, 'The body of igneous rock formed by the process of emplacement of magma in pre-existing rock', 'pluton', '2008-01-11 00:00:00', NULL, 167916112856012582, 969);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012657, 'horst', NULL, 'An elongate block bounded on both sides by normal faults that dip away from the interior of the horst.', NULL, '2008-01-11 00:00:00', NULL, 167916112856012582, 968);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012658, 'half-graben', NULL, 'An elongate trough or basin bounded on one side by a normal fault.', NULL, '2008-01-11 00:00:00', NULL, 167916112856012582, 967);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012659, 'graben', NULL, 'An elongate trough or basin bounded on both sides by normal faults that dip toward the interior of the trough.', NULL, '2008-01-11 00:00:00', NULL, 167916112856012582, 966);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012660, 'fan', NULL, 'A gently sloping, fan-shaped mass forming a section of a very low cone.', NULL, '2008-01-11 00:00:00', NULL, 167916112856012582, 965);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012661, 'equant', NULL, 'A rock body whose extent in all three dimensions is approximately equal.', NULL, '2008-01-11 00:00:00', NULL, 167916112856012582, 964);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012662, 'dome', NULL, 'A body in which the rocks dip gently away in all directions from the top of the body, such as an uplift or anticlinal structure.', NULL, '2008-01-11 00:00:00', NULL, 167916112856012582, 963);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012663, 'diapirism', NULL, 'The process of piercing or rupturing of domed or uplifted rocks by mobile core material, by tectonic stresses as in anticlinal folds, by the effect of geostatic load in sedimentary strata as in salt domes and shale diapirs, or by igneous intrusion, forming diapiric structures such as plugs.', NULL, '2008-01-10 00:00:00', NULL, 167916112856012594, 962);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012664, 'diapir', NULL, 'A spherical, elliptical or teardrop-shaped body formed by doming or extrusion of lower density magmatic or mobile sedimentary material into overlying rocks.', NULL, '2008-01-10 00:00:00', NULL, 167916112856012582, 961);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012665, 'cone', NULL, 'A body shaped like a cone, having relatively steep sides and a pointed top.', NULL, '2008-01-10 00:00:00', NULL, 167916112856012582, 960);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012666, 'column', NULL, 'An upright shaft or body of greater length than thickness.', NULL, '2008-01-10 00:00:00', NULL, 167916112856012582, 959);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012667, 'channel', NULL, 'An elongate lens with a convex downward lower surface, near planar upper surface.', NULL, '2008-01-10 00:00:00', NULL, 167916112856012582, 958);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012668, 'boudin', NULL, 'A layer or bed of rock deformed into sausage shaped segments (boudins), either separated or joined by pinched connections.', NULL, '2008-01-10 00:00:00', NULL, 167916112856012582, 957);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012669, 'bomb', NULL, 'A clot of lava, usually mafic-ultramafic, ejected from a volcanic vent while viscous, and which assumes a rounded shape as it solidifies in flight.', NULL, '2008-01-10 00:00:00', NULL, 167916112856012582, 956);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012670, 'blanket', NULL, 'A thin, sheet-like, laterally extensive rock body which covers an underlying substrate; characterised by a sharp base, deposition is essentially parallel to the topographic surface.', NULL, '2008-01-10 00:00:00', NULL, 167916112856012582, 955);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012671, 'bed [morphology]', NULL, 'A tabular sedimentary body bounded above and below by more or less well-defined bedding surfaces.', NULL, '2008-01-10 00:00:00', NULL, 167916112856012582, 954);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012672, 'basin', NULL, 'The shape of a body of sedimentary rock deposited in a low area in the Earth*s crust.', NULL, '2008-01-10 00:00:00', NULL, 167916112856012582, 953);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012673, 'arch', NULL, 'A raised, elongate body of rock.', NULL, '2008-01-10 00:00:00', NULL, 167916112856012582, 952);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012674, 'shear zone', NULL, 'A parallel-sided zone of localised shearing displacement.', NULL, '2008-01-10 00:00:00', NULL, 167916112856012568, 951);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012675, 'fault zone', NULL, 'A zone of discrete surfaces separating two rock masses across which one mass has slid past the other.', NULL, '2008-01-10 00:00:00', NULL, 167916112856012568, 950);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012676, 'fault [environment]', NULL, 'A discrete surface separating two rock masses across which one mass has slid past the other.', NULL, '2008-01-10 00:00:00', NULL, 167916112856012568, 949);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012677, 'correlates with [temporal]', NULL, 'A concept that corresponds in age and character with another concept.', NULL, '2008-01-10 00:00:00', NULL, 167916112856012556, 948);
