INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012679, 'equivalent to [temporal]', NULL, 'A concept that is equivalent in age to another concept.', 'contemporaneous with', '2008-01-10 00:00:00', NULL, 167916112856012556, 946);
