INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012911, 'Wb/A.m', 'Wb/A.m', NULL, NULL, '2007-11-23 00:00:00', NULL, 167916112856012590, 855);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012683, 'underlies [unconformable]', NULL, 'The concept that is stratigraphically below the unconformity.', NULL, '2008-01-10 00:00:00', NULL, 167916112856012557, 942);
