INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012829, 'holomelanocratic', NULL, 'Colour index 90-100 M*, corresponding to 90-100 percent mafic minerals.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012553, 568);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012830, 'melanocratic', NULL, 'Dark coloured, generally rich in mafic minerals; colour index 65-90 M*, corresponding to 65-90 percent mafic minerals.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012553, 567);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012831, 'mesocratic', NULL, 'Roughly equal amounts light and dark constituents, colour index 35-65 M*, corresponding to 35-65 percent mafic minerals.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012553, 566);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012832, 'leucocratic', NULL, 'Light-coloured; colour index 10-35 M*, corresponding to a generally low mafic mineral content (10-35 percent).', NULL, '2007-11-15 00:00:00', NULL, 167916112856012553, 565);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012833, 'hololeucocratic', NULL, 'Colour index of 0-10 M*, corresponding to 0-10 percent mafic minerals.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012553, 564);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012834, 'wave action', NULL, 'Erosion, transport and deposition of material by wave action either on the seacoast or along lake edges.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 563);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012835, 'tidal processes', NULL, 'Erosion, transport and deposition of material by movement of tidal currents.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 562);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012868, 'clay hardening', NULL, 'Induration of regolith by clay materials.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 529);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012836, 'storm processes', NULL, 'Any process that acts as a result of a violent disturbance of normal atmospheric conditions; usually manifests as unusually forceful wind and/or waves.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 561);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013148, 'epidote alteration', 'EPID', 'Hydrothermal introduction of epidote into rocks or the alteration of rocks in which plagioclase feldspar is albitized, freeing the anorthite molecule for the formation of epidote and zoisite often accompanied by chloritization.', 'epidotisation;epidotization', '2007-11-15 00:00:00', NULL, 167916112856012594, 468);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012838, 'piping', NULL, 'Erosion by percolating water in subsoil layer, forming narrow conduits, tunnels or pipes (caving) through which soluble or granular soil material is removed.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 559);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012839, 'sheet flow', NULL, 'Erosion, transport and deposition of material by unconfined flow of sheets of water flowing over the ground surface; commonly removes fine material, leaving coarser material behind as a lag deposit.', 'surface washsheet wash', '2007-11-15 00:00:00', NULL, 167916112856012594, 558);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012840, 'over-bank stream flow', NULL, 'Erosion, transport and deposition of material on flood plains and other areas adjacent to rivers by water which has flowed out of a confined channel (over-bank deposits).', 'overbank stream flow', '2007-11-15 00:00:00', NULL, 167916112856012594, 557);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012841, 'hydration shattering', NULL, 'Process of grain loosening and rock disintegration by the wedging pressure of water in films of varying thickness on silicate mineral surfaces; grus accumulates as the product of this process.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 556);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012842, 'detrital deposition still water', NULL, 'Deposition of detrital material from a body of standing water onto the floor of the basin; in terrestrial landscapes this occurs in lakes; sources of detrital material include channel flow into the lake, and wave action along lake edges.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 555);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012843, 'channelled stream flow', NULL, 'Erosion, transport and deposition of material in stream channels; commonly results in well-sorted deposits that are confined to river channels, either modern or relict (channel deposits).', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 554);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012845, 'dust deposition', NULL, 'Deposition of dust being transported by wind in the atmosphere as suspended load; process responsible for deposition of loess; where the dust is composed of clay pellets it forms a special kind of loess, sometimes called parna in Australia.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 552);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012846, 'sand deposition', NULL, 'Deposition of sand by wind to form various landform types including dunes and sand sheets.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 551);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012847, 'wind erosion', NULL, 'Erosion of material by the action of wind; may involve entrainment of sand and dust particles, and their movement to other locations; also includes the action of sand corrasion to produce ventifacts.', 'deflation', '2007-11-15 00:00:00', NULL, 167916112856012594, 550);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012848, 'aeolian [process]', NULL, 'Erosion, transport and deposition of material by wind, eg. saltation, turbulent suspension, surface creep.', 'wind', '2007-11-15 00:00:00', NULL, 167916112856012594, 549);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013199, 'lava flow [environment]', NULL, 'Formed in an area of lava flowing over the Earth*s surface.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012570, 268);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (80, 'consolidationDegree', NULL, NULL, NULL, '2007-10-26 00:00:00', NULL, 75, NULL);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012849, 'reworking', NULL, 'Any process that removes or displaces sediment, rock fragments, fossils or other material from its place of origin and incorporates it in a recognisable form into a younger formation; applies only to natural processes.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 548);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012850, 'impact by meteors', NULL, 'Formation or changes in the shape of landforms by meteorite impact, typically to produce craters.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 547);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012851, 'glacial deposition', NULL, 'Deposition of material from melting ice; general term moraine refers to the deposits.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 546);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012852, 'glacial erosion', NULL, 'Erosion and transport of material by glacial ice, giving rise to distinctive landforms such as U-shaped valleys and cirques.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 545);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012853, 'frost', NULL, 'Freezing and thawing of water, which leads to shattering and movement of rock fragments, and disturbance of soil material; processes include solifluction, and the development of patterned ground.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 544);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012854, 'ice', NULL, 'Any process of erosion, transport and deposition of material by moving ice.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 543);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012855, 'vertical collapse', NULL, 'Collapse of large fragments of rock and/or soil, commonly from cliff faces; collapsed materials accumulate where they fall, and may be acted on by other processes.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 542);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012856, 'rock fall', NULL, 'Relatively free falling or precipitous movement of a newly detached segment of rock of any size from a cliff or very steep slope.', 'rockfall', '2007-11-15 00:00:00', NULL, 167916112856012594, 541);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012857, 'particle fall', NULL, 'More-or-less free fall of small particles of rock and/or soil from or near vertical faces.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 540);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012858, 'lahar', NULL, 'Mudflow of volcanogenic material on the flanks of a volcano.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 539);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012859, 'mudflow [process]', NULL, 'Turbulent movement of material down slope under the influence of gravity; the moving mass tumbles, rolls and flows down slope; the resulting deposit is a mixture of material of all sizes; no obvious orientation or indication of original structure.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 538);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012860, 'landslide', NULL, 'Translational movement of material along a shear plane under the influence of gravity, either as a single coherent mass or a number of sliding fragments; material generally maintains its orientation relative to the land surface.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 537);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013007, 'commonly', NULL, 'Much of the time, on many occasions.', 'frequently;often;mostly;generally;typically;significantly;usually;abundant', '2007-11-23 00:00:00', NULL, 167916112856012532, 761);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012862, 'creep', NULL, 'Slow movement of rock and/or soil particles down slope under the influence of gravity.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 535);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012863, 'gravity [process]', NULL, 'Any process that acts mainly as a result of gravity.', 'mass wasting', '2007-11-15 00:00:00', NULL, 167916112856012594, 534);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012864, 'human agents', NULL, 'Formation or changes in the shape of landforms by human activity.', 'anthropogenic processes', '2007-11-15 00:00:00', NULL, 167916112856012594, 533);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012865, 'siliceous induration', NULL, 'In situ cementation and/or replacement of regolith by silica.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 532);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012866, 'gypsiferous induration', NULL, 'In situ cementation and/or replacement of regolith by gypsum.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 531);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012867, 'ferruginous induration', NULL, 'Cementing by iron to form ferricrete, sometimes referred to as lateritic duricrust.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 530);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971447769340, 'limonite', 'Lm', NULL, NULL, '2008-05-15 00:00:00', NULL, 1677736971447769088, 1309);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012869, 'calcareous induration', NULL, 'In situ cementation and/or replacement of regolith by carbonate.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 528);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012870, 'bauxitic induration', NULL, 'Cementing largely by aluminous materials.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 527);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012871, 'induration', NULL, 'Absolute or relative accumulation of a cementing agent to form a duricrust; sometimes the cementing agent replaces regolith materials.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 526);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012872, 'biotic weathering', NULL, 'Combination of chemical and physical weathering brought about by biological agents; it has a wide variety of effects, but is not usually more than locally important.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 525);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012873, 'precipitation', NULL, 'Chemicals precipitated from solution and  deposited in various parts of the landscape; may be an important source of materials in some parts of the landscape, especially where water comes to the surface and is then evaporated.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 524);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012874, 'ferrolysis', NULL, 'Replacement of Ca, K, Na ions with Fe ions; the former are then lost to the soil water or ground water.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 523);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299231, 'faulted contact', NULL, 'Contact between two Geological Units that is a fault.', NULL, '2008-05-22 00:00:00', NULL, 1677736972070299358, 1541);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012875, 'hydrolysis', NULL, 'A chemical reaction between minerals and the H+ and OH- ions of water.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 522);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012876, 'chelation', NULL, 'The holding of an ion, usually a metal, within a ring structure of organic origin; an important process involving both mineral and organic materials; also called complexing.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 521);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012877, 'hydration', NULL, 'The addition of water to a mineral to form hydrated mineral forms, or hydroxides; an important process in clay mineral formation.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 520);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012878, 'carbonation', NULL, 'The reaction of carbonate or bicarbonate ions with minerals; carbon dioxide is common in soil and air, and carbonation can be quite rapid where carbonic acid is readily available.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 519);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012879, 'oxidation and reduction', NULL, 'Reaction between minerals and oxygen to produce oxides or hydroxides (oxidation) or reaction in waterlogged and other anaerobic sites (reduction); alternating oxidation and reduction often leads to mottling of weathered materials.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 518);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012880, 'solution', NULL, 'Usually the first stage of chemical weathering; may take place in running water or in a thin film of water round a solid particle; dissolved chemicals are removed from the weathering rock.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 517);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012881, 'chemical weathering', NULL, 'Any chemical alteration of rocks or minerals; it results from chemical reactions of minerals with air and water.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 516);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012882, 'wetting and drying', NULL, 'Repeated wetting and drying of rock materials, leading to physical beak down of the materials into smaller fragments.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 515);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012883, 'volume increase', NULL, 'Chemical alteration of rocks and minerals may cause an increase in volume; this volume increase usually leads to exfoliation, the peeling of thin shells of material from the parent rock.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 514);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012884, 'salt weathering', NULL, 'The growth of salt crystals from solution causing breakdown of rock materials in a manner similar to that caused by freezing of water.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 513);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012885, 'sheeting', NULL, 'The division of rock into sheets by joint-like fractures that are generally parallel to the ground surface; caused by pressure release and expansion of rock masses following erosion; also called topographic jointing.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 512);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012886, 'moisture swelling', NULL, 'Considerable changes in rock volume can be caused by a reversible absorption of moisture; the volume changes may be enough to cause physical weathering.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 511);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012887, 'insolation weathering', NULL, 'Expansion and/or shrinkage of rocks resulting in rock fracture, due to changes in temperature caused by the sun.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 510);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012888, 'induced fracture', NULL, 'The result of a large rock resting on an underlying rock, setting up stresses that can act on both the underlying and overlying rock.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 509);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012889, 'frost weathering', NULL, 'Breaking and separation of rock fragments by the force exerted when water freezes to ice; freeze-thaw cycles are very important in the breakdown and mixing of rock and soil material.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 508);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012890, 'abrasion', NULL, 'The mechanical breaking of rocks or minerals by either friction or impact; friction is common at the base of glaciers, for example, whereas impact abrasion is more common in streams and in areas of wind transport.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 507);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012891, 'physical weathering', NULL, 'Any process that leads to a reduction in the size of rock fragments.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 506);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012892, 'weathering', NULL, 'Any process that modifies rocks, either physically by reducing the size of fragments, or chemically by altering the composition of constituent rock materials.', 'regolith forming', '2007-11-15 00:00:00', NULL, 167916112856012594, 505);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012893, 'recrystallisation [general]', NULL, 'Process by which new crystalline mineral grains form in a rock, essentially in the solid state.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 504);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012894, 'metasomatism', NULL, 'Metamorphism, local or regional, involving substantial changes of chemical composition (other than addition or subtraction of water).', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 503);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012895, 'radioactivity metamorphism', NULL, 'Metamorphism of local extent caused by natural nuclear fission.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 502);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012896, 'lightning metamorphism', NULL, 'Metamorphism of local extent due to a lightning strike.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 501);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012898, 'mdarcy', 'mdarcy', NULL, NULL, '2007-11-23 00:00:00', NULL, 167916112856012590, 868);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012900, 'ft/s', 'ft/s', NULL, NULL, '2007-11-23 00:00:00', NULL, 167916112856012590, 866);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012901, 'W/(m.K)', 'W/m/K', 'Watts per Kelvin-metre.', NULL, '2007-11-23 00:00:00', NULL, 167916112856012590, 865);
