INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013146, 'Yellowish gray [5Y 7/2]', '5Y 7/2', 'The colour defined by the value 5Y 7/2 in Munsell colour space.  Refer to the specific colour chip in the reference chart.', NULL, '2007-11-16 00:00:00', NULL, 167916112856012551, 623);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013214, 'island forearc', NULL, 'Region adjacent to an island arc, between the arc and subduction-related trench.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 253);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013215, 'forearc', NULL, 'The region between a subduction-related trench and a volcanic arc.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 252);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013147, 'greisenisation', 'GRSN', 'Type of alteration whose minerals are enriched in fluorine, boron, and the alkali metals (Na, K, and Li); characteristic minerals include tourmaline, topaz, muscovite, zinnwaldite, fluorite, alkali feldspars and/or kaolinite.', 'greisenization;greisening', '2007-11-15 00:00:00', NULL, 167916112856012594, 469);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012837, 'linear erosion', NULL, 'Linear erosion by water, producing steep sided channels; rills are less than 0.3m deep and gullies are more than 0.3m deep.', 'rilling;gullying', '2007-11-15 00:00:00', NULL, 167916112856012594, 560);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013149, 'deuteric alteration', 'DEUT', 'Albitic alteration, potassic alteration, tourmaline alteration, silicification or greisen formation, through reactions between primary magmatic minerals and water-rich solutions that separate from the same body of magma late in its cooling history.', 'autometasomatism', '2007-11-15 00:00:00', NULL, 167916112856012594, 467);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013150, 'chloritic alteration', 'CLOR', 'Replacement by, conversion into, or introduction of chlorite; mineral assemblages comprise chlorite with subordinate sericite, quartz and pyrite.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 466);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299228, 'faulted relationship (unit/unit)', NULL, 'Geological Unit or Earth Material juxtaposed against another Geological Unit or Earth Material by a discrete surface or zone along which one side has moved relative to the other.', NULL, '2008-05-24 00:00:00', NULL, 1677736972070299358, 1548);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013152, 'advanced argillic alteration', 'ARGIA', 'Assemblages are dominated by kaolinite group clay minerals; dickite, kaolinite, diaspore and pyrophyllite may occur with sericite, quartz, alunite, pyrite, tourmaline, topaz, zunyite and amorphous clays (allophane).', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 464);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013153, 'intermediate argillic alteration', 'ARGII', 'Replacement or alteration of feldspars to form predominantly clay minerals, including kaolinite group, smectite (montmorillonite) group, illite group and the amorphous clays (allophane).', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 463);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013154, 'argillic alteration', 'ARGI', 'Replacement or alteration of feldspars to form clay minerals.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 462);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013155, 'hydrothermal alteration', NULL, 'Alteration of rocks or minerals by the reaction of hydrothermal water with pre-existing solid phases.', 'wall-rock alteration;wallrock alteration', '2007-11-15 00:00:00', NULL, 167916112856012594, 461);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013156, 'heating', NULL, 'Any process that causes an increase in temperature of a rock body.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 460);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013157, 'quench fragmentation', NULL, 'Fragmentation process that occurs as a result of contact between hot magma and colder bodies of water, steam, debris and rock.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 459);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013158, 'autobrecciation', NULL, 'Fragmentation process whereby portions of consolidated crust on a lava mass are incorporated into the still-fluid portion.', 'flow fragmentation', '2007-11-15 00:00:00', NULL, 167916112856012594, 458);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013159, 'autoclastic processes', NULL, 'Any process of fragmentation of a coherent lava during flow or interaction between the lava and its surroundings, or gravity crumbling of spines or domes.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 457);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013160, 'lava fountain', NULL, 'Jet of incandescent lava shot into the air as the magma reaches the surface.', 'fire fountain', '2007-11-15 00:00:00', NULL, 167916112856012594, 456);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013161, 'lava flow [process]', NULL, 'Lateral, surficial outpouring of molten lava from a vent or fissure.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 455);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299230, 'sheared', NULL, 'Relationship in which a Geological Unit or Earth Material is disrupted by a discrete zone containing planes of differential movement.', NULL, '2008-05-22 00:00:00', NULL, 1677736972070299358, 1540);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013163, 'phreatomagmatic eruption', NULL, 'Explosive eruption caused by interaction between magma and groundwater or shallow surface water.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 453);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013164, 'base surge', NULL, 'Ring-shaped cloud of gas and suspended solid debris moving radially outwards at high velocity as a density flow from the base of a vertical explosion column.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 452);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013165, 'pyroclastic surge', NULL, 'Low density, dilute, turbulent pyroclastic flow.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 451);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013166, 'pyroclastic gravity current', NULL, 'Density current of pyroclastic material, usually very hot; composed of varying mixtures of gases and particles.', 'pyroclastic flow', '2007-11-15 00:00:00', NULL, 167916112856012594, 450);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013167, 'pyroclastic fall', NULL, 'Airborne pyroclastic material falling from an eruption cloud.', 'ash fallpumice fall', '2007-11-15 00:00:00', NULL, 167916112856012594, 449);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013168, 'explosive eruption', NULL, 'Eruption characterised by the energetic ejection of pyroclastic material.', 'pyroclastic eruption', '2007-11-15 00:00:00', NULL, 167916112856012594, 448);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013169, 'eruption', NULL, 'The ejection of volcanic materials onto the Earth*s surface; includes eruptions into water.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 447);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013170, 'karstification', NULL, 'Action by water, mainly chemical but also mechanical, that produces features of karst environments, eg. sinkholes, caves and shafts.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 446);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013171, 'incision', NULL, 'The action of a stream cutting into the substrate.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 445);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013172, 'pressure release', NULL, 'Exfoliation caused by the release of confining pressure of a once deeply buried rock as it is brought nearer the surface by erosion.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 444);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013173, 'exfoliation', NULL, 'The process by which concentric plates or shells of rock are successively spalled or stripped from the bare surface of a large rock mass; caused by physical or chemical forces producing differential stresses in the rock mass.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 443);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013174, 'denudation', NULL, 'The laying bare, uncovering or exposure of bedrock or a designated rock formation through the removal of overlying rock material by erosion.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 442);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013175, 'erosion', NULL, 'General term for the process of wearing away the land surface and movement of products; includes both denudation and depositional processes.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 441);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013176, 'concretion formation', NULL, 'Precipitation of mineral matter from aqueous solution in the pores of sedimentary or fragmental volcanic material about some nucleus, to form a hard, compact mass or aggregate; generally subspherical or oblate, but may be other shapes.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 440);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013177, 'leaching [diagenesis]', NULL, 'Process of separation, selective removal, or dissolving-out of soluble constituents from a rock by the natural action of percolating water.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 439);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971447769299, 'NW', NULL, 'NW', NULL, '2008-02-24 00:00:00', NULL, 1677736971447769074, 1170);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (103893, 'geological unit part', NULL, NULL, NULL, '2008-07-10 00:00:00', NULL, 103890, NULL);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013178, 'overgrowth', NULL, 'Process of secondary material depositing in crystallographic and optical continuity around a crystal grain of the same composition; also called secondary enlargement.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 438);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013179, 'recrystallisation [authigenesis]', NULL, 'Process of formation of new crystalline mineral grains in a rock; essentially solid-state; new grains are generally larger than the original grains; new grains may have the same or a different mineralogical composition.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 437);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013180, 'replacement', NULL, 'Process of solid-state change in composition of a mineral or mineral aggregate.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 436);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013181, 'authigenesis', NULL, 'The process by which new minerals form in place within an enclosing sediment or sedimentary rock during or after deposition.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 435);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013182, 'cementation', NULL, 'Diagenetic process that lithifies or consolidates coarse clastic sediments, through deposition or precipitation of minerals in the spaces among the individual grains of the sediment; may also occur by secondary enlargement of grains.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 434);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013183, 'compaction', NULL, 'Diagenetic process that causes a reduction in bulk volume, thickness of, or pore space within a body of fine-grained sediments, in response to the increasing weight of overlying material or pressures from earth movements within the crust.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 433);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013184, 'alluvial terrace', NULL, 'Formed in a former floodplain that is no longer active due to deepening or enlarging of the stream channel.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012566, 283);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013185, 'alluvial fan [environment]', NULL, 'Formed in a localised area of enhanced sedimentation where a previously laterally confined flow expands, as in a narrow valley expanding on to a low lying valley floor or coastal plain.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012566, 282);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013186, 'floodplain', NULL, 'Formed in the generally flat area adjacent to a stream channel by deposition from suspension in flood waters.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012566, 281);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013187, 'crevasse splay', NULL, 'Formed in an area of accumulation in a low energy delta perpendicular to a channel, by a break in a levee during flooding.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012566, 280);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013188, 'levee', NULL, 'Formed in a levee: a long broad low ridge or embankment of sand and coarse silt built by a stream on its floodplain and along both banks of its channel, especially in times of flood; it has a gentle slope away from the river and toward the surrounding floodplain and its highest elevation is closest to the river bank, at or near normal flood level.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012566, 279);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013189, 'overbank area', NULL, 'The area of overflow of a stream channel.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012566, 278);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013190, 'meandering channel', NULL, 'Formed in a meandering stream channel.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012566, 277);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013191, 'braided channel network', NULL, 'Formed in a stream channel network that merges and diverges to form an anastomosing pattern in plan view.', 'anastomosing', '2007-11-02 00:00:00', NULL, 167916112856012566, 276);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013192, 'channel', NULL, 'Formed in the channel of a stream.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012566, 275);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013193, 'fluvial', NULL, 'Formed in or near a stream or river.', 'alluvial', '2007-11-02 00:00:00', NULL, 167916112856012566, 274);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013194, 'deep crustal', NULL, 'Formed in or near an intrusion emplaced into the deep crust.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012569, 273);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013195, 'mid-crustal', NULL, 'Formed in or near an intrusion emplaced at moderate crustal depths.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012569, 272);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013196, 'subaqueous subvolcanic', NULL, 'Formed in or near an intrusion emplaced into water-saturated sediment (eg. hyaloclastite, peperite).', NULL, '2007-11-02 00:00:00', NULL, 167916112856012569, 271);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013197, 'subvolcanic', NULL, 'Formed in or near an intrusion emplaced at shallow crustal depth; characteristics of rocks created in this environment include miarolitic cavities.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012569, 270);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013198, 'lava dome [environment]', NULL, 'Formed in a lava flow of very high aspect ratio (thickness/area); generally circular with a small surface area.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012570, 269);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013200, 'volcanic plain [environment]', NULL, 'Formed in an area built up by extensive lava or ash flows that cover existing topography.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012570, 267);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013201, 'maar', NULL, 'Formed in, or in the area immediately under, a maar: a low relief, broad volcanic crater formed by multiple shallow explosive eruptions.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012570, 266);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013202, 'volcanic cone [environment]', NULL, 'Formed in, or in the area immediately under, a volcanic cone: a conical hill of lava and/or pyroclastics that is built up around a volcanic vent.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012570, 265);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971447769300, 'WNW', NULL, 'WNW', NULL, '2008-02-24 00:00:00', NULL, 1677736971447769074, 1169);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971447769301, 'mud', NULL, 'Less than 0.032mm.', NULL, '2008-02-22 00:00:00', NULL, 1677736971447769072, 1068);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012993, 'extremely', NULL, 'To a very strong degree.', NULL, '2007-11-23 00:00:00', NULL, 167916112856012532, 775);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013049, 'nonmagnetic', '*1nT', 'The magnetic intensity is less than 1 nT.', NULL, '2007-11-22 00:00:00', NULL, 167916112856012543, 719);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013203, 'shield volcano [environment]', NULL, 'Formed in, or in the area immediately under, a shield volcano: a volcano in the shape of a flattened dome, broad and low, built by flows of very fluid basaltic lava or by rhyolitic ash flows.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012570, 264);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013204, 'caldera complex', NULL, 'Formed in, or in the area immediately under, a caldera: a large, basin-shaped volcanic depression, more or less circular or cirquelike in form, the diameter of which is many times greater than that of the included vent(s); formed by collapse during an eruption.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012570, 263);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013205, 'eruption centre [environment]', NULL, 'Formed in, or in the area immediately under, a volcanic eruption centre.', 'volcano', '2007-11-02 00:00:00', NULL, 167916112856012570, 262);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013206, 'transrotational basin', NULL, 'Basin formed by rotation of crustal blocks about vertical axes within a strike-slip fault system.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 261);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013207, 'transtensional basin', NULL, 'Basin formed by extension along a strike-slip fault system.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 260);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013208, 'transpressional basin', NULL, 'Basin formed by compression along a strike-slip system.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 259);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013209, 'pull-apart', NULL, 'Topographic depression centered over an extensional bend or extensional step-over in strike slip fault.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 258);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013210, 'leaky transform', NULL, 'Dominantly transform boundary punctuated by short spreading ridge segments.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 257);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013211, 'transform', NULL, 'A plate boundary where lithosphere is neither created or destroyed, and plates slide past each other on a strike-slip fault.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 256);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013212, 'fore-arc basin', NULL, 'Basins within arc-trench gaps.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 255);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013213, 'continental forearc', NULL, 'Region adjacent to a continental arc, between the arc and the subduction-related trench.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 254);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013216, 'intra-arc basin', NULL, 'Basin along arc platform, which includes superposed and overlapping volcanoes.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 251);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013217, 'intra-arc rift', NULL, 'Linear topographic depression bounded by normal faults, running through or just behind the arc axis.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 250);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013218, 'continental arc axis', NULL, 'Arcuate line of volcanoes based on continental crust.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 249);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013219, 'island arc axis', NULL, 'Arcuate line of volcanoes based on oceanic crust.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 248);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013220, 'arc axis', NULL, 'Line of volcanoes formed above a subduction zone.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 247);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013221, 'retro-arc foreland basin', NULL, 'Foreland basin on continental side of continental-margin arc-trench system (formed by subduction-generated compression and/or collision).', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 246);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013222, 'continental backarc basin', NULL, 'Continental basin behind continental margin magmatic arc without a foreland fold-thrust belt.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 245);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013223, 'oceanic backarc basin', NULL, 'Oceanic basin behind intraoceanic magmatic arc (including basins between active and remnant arcs).', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 244);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013224, 'continental backarc', NULL, 'Back-arc of a continental arc, with continental crust forming basement.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 243);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013225, 'island backarc', NULL, 'Back-arc of an island arc, with oceanic crust forming the basement.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 242);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013226, 'backarc', NULL, 'Region adjacent to subduction-related volcanic arc, on the side opposite the trench and subducting plate.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 241);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013227, 'magmatic arc', NULL, 'Arcuate line of plutons, volcanic rocks,or active volcanoes presumed to have formed at a subduction zone.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 240);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013228, 'trench-slope basin', NULL, 'Local structural depression developed on subduction complex.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 239);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013229, 'accretionary complex', NULL, 'Generally wedge-shaped mass of tectonically deformed sediment at a subduction zone, formed by strata from the descending plate accreting to the overlying plate margin.', 'accretionary prism', '2007-11-02 00:00:00', NULL, 167916112856012593, 238);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013230, 'trench', NULL, 'Deep trough in the ocean floor formed by subduction of oceanic lithosphere.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 237);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013231, 'subduction zone', NULL, 'Convergent plate boundary where oceanic lithosphere is underthrust below oceanic or continental lithosphere.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 236);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013232, 'layered mafic/ultramafic complex', NULL, 'Large intrusion of layered mafic and ultramafic rock in continental crust.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 191);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013233, 'flood basalt province [continental]', NULL, 'Vast composite accumulation of horizonal or subhorizontal basaltic lava flows.', 'plateau basalt', '2007-11-02 00:00:00', NULL, 167916112856012593, 190);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013234, 'hot spot [continental]', NULL, 'Volcanic centre 100-200km across and persistent for at least a few tens of millions of years; thought to be the surface expression of a persistent plume.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 189);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013235, 'intra-continental basin', NULL, 'A basin developed on continental crust and which may be shallow marine or non-marine.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 188);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013236, 'impactogen', NULL, 'Rift formed at high angles to orogenic belts, without pre-orogenic history.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 187);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013238, 'continental platform', NULL, 'Stable craton covered with thin and laterally extensive sedimentary strata.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 185);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013239, 'sag', NULL, 'A basin or downwarp of regional extent.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 184);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013240, 'shield', NULL, 'Large area of exposed basement rocks in a craton, commonly with very gently convex surface, surrounded by sediment-covered platforms; virtually all are Precambrian.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 183);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013241, 'craton', NULL, 'Part of the Earth*s crust that has attained stability and has been little deformed for a prolonged period.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 182);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1679161121580275446, 'Accepted', 'Accepted', 'Current Status for Geological Unit, Please read use case documents for business logic', NULL, '2006-12-04 00:00:00', NULL, 1679161121580275188, 2);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013244, 'middle crust', NULL, 'A general term for the middle part of the Earth*s crust underlying continents.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 179);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013245, 'upper crust', NULL, 'A general term for the upper part of the Earth*s crust underlying continents.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 178);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013246, 'continental crust', NULL, 'Earth*s crust underlying continents, 30 - 70 km thick.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 177);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013247, 'fracture zone', NULL, 'Inactive transform fault, forming a long scarp on the sea floor.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 176);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013248, 'remnant arc', NULL, 'Extinct arc portion forming a submarine aseismic ridge rifted away by opening of a back-arc basin.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 175);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013249, 'flood basalt province [oceanic]', NULL, 'Vast composite accumulation of horizonal or subhorizontal basaltic lava flows.', 'plateau basalt', '2007-11-02 00:00:00', NULL, 167916112856012593, 174);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013250, 'oceanic plateau', NULL, 'Plateau rising up from abyssal plain, largely or entirely under water.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 173);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013251, 'aseismic ridge', NULL, 'Elongate steep-sided submarine volcanic ridge that marks the track of a mantle plume across the oceanic lithosphere during plate motion.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 172);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013252, 'hot spot [oceanic]', NULL, 'Volcanic centre 100-200km across and persistent for at least a few tens of millions of years; thought to be the surface expression of a persistent plume.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 171);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013253, 'dormant ocean basin', NULL, 'Basin floored by oceanic crust, which is neither spreading nor subducting (no acitive plate boundaries within or adjoining basin).', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 170);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013254, 'active ocean basin', NULL, 'Basin floored by oceanic crust formed at divergent plate boundaries unrelated to arc-trench systems (spreading still active).', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 169);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013255, 'gabbro facies', NULL, 'Upper section is massive-noncumulate plutonic rocks, mafic to ultramafic, lower section is cumulate, common cyclic layering, contorted layering and other evidence of deformation; Layer 3 of Jackson.', 'Layer 3', '2007-11-02 00:00:00', NULL, 167916112856012593, 168);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013256, 'sheeted dykes facies', NULL, 'Dyke complex, commonly with dyke within dyke relations; also called Layer 3; Layer 2b of Jackson.', 'Layer 3Layer 2b', '2007-11-02 00:00:00', NULL, 167916112856012593, 167);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013257, 'pillow basalt facies', NULL, 'Pillow lavas, breccias and some massive flows; also called Layer 2; Layer 2a of Jackson.', 'Layer 2Layer 2a', '2007-11-02 00:00:00', NULL, 167916112856012593, 166);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013258, 'sedimentary facies', NULL, 'Pelagic sediments or abyssal deep-sea fan terriginous or arc type deposits; also called Layer 1.', 'Layer 1', '2007-11-02 00:00:00', NULL, 167916112856012593, 165);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013259, 'abyssal plain [tectonic setting]', NULL, 'Normal ocean floor typically at a depth of 4 - 6 km below sea level, with a thin cover of deep marine sediments, forming a very flat surface.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 164);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (16, 'GeologicalEvent', NULL, 'Geological Event', NULL, '2007-10-25 00:00:00', NULL, 15, NULL);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012897, 'microdarcy', 'microdarcy', NULL, NULL, '2007-11-23 00:00:00', NULL, 167916112856012590, 869);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013260, 'marginal basin', NULL, 'A basin marginal to a continent, usually with a volcanic arc on its oceanward side.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012593, 163);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013261, 'oceanic crust', NULL, 'Earth*s crust which underlies the ocean basins; typically 5-10km thick, density 2.9g/cm3, compressional seismic wave velocities of 4-7.5km/sec.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012593, 162);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013262, 'crust', NULL, 'Outermost zone of Earth.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012593, 161);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013263, 'ultramafic facies [sub-continental]', NULL, 'Peridotite, pyroxenite.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012593, 160);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013264, 'sub-continental mantle', NULL, 'Mantle underlying continental crust.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012593, 159);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013265, 'ultramafic facies [sub-oceanic]', NULL, 'Ultramafic tectonite, peridotite with discontinuous layers of dunite and concentrations of chromite; Layer 4 of Jackson.', 'Layer 4', '2007-11-01 00:00:00', NULL, 167916112856012593, 158);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013266, 'sub-oceanic mantle', NULL, 'Mantle underlying oceanic crust.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012593, 157);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013267, 'mantle', NULL, 'Zone of the Earth between the crust and the core.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012593, 156);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013268, 'continental rift', NULL, 'Simple to complex fault-bounded valleys to 70km wide and 1000s kms long in thin crust under tension with high, low order seismisity and immature terrigenous clastic sediments and bimodal volcanics, active rifts have more volcanics.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012593, 155);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013269, 'plate interior', NULL, 'The area of a plate not near the plate boundary; plate: a torsionally rigid thin segment of the Earth*s lithosphere, which may be assumed to move horizontally and adjoins other plates along zones of seismic activity.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012593, 154);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013270, 'lithosphere', NULL, 'Solid portion of the Earth (not hydrosphere or atmosphere) that in plate tectonics acts as a strong layer relative to the asthenosphere; includes the crust and part of the upper mantle; in the order of 100km thick.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012593, 153);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013271, 'alkaline series', NULL, 'Magma series including, among other rock types, one or more of melilitite, nephelinite, tephrite, alkali basalt, hawaiite, mugearite, phonolite or their plutonic equivalents.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012571, 152);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013272, 'calc-alkaline rock series', NULL, 'Silica-oversaturated volcanic rocks; typical products of arc volcanism.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012571, 151);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013273, 'tholeiite rock series', NULL, 'Magma series characterised by silica oversaturation and by strong iron enrichment on an AFM diagram.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012571, 150);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013274, 'komatiite suite', NULL, 'An igneous suite distinguished by the presence of ultramafic lavas.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012571, 149);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971447769364, 'cement', NULL, NULL, NULL, '2008-02-21 00:00:00', NULL, 1677736971447769084, 994);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013275, 'ophiolitic suite', NULL, 'Igneous suite characterised by the association of ultramafic rocks, coarse-grained gabbro, coarse-grained dolerite, volcanic rocks and radiolarian chert.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012571, 148);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013276, 'A-type', NULL, 'Igneous rock with characteristic mineralogy and chemistry, thought to be emplaced in anorogenic settings.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012572, 147);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013277, 'S-type', NULL, 'Igneous rock with characteristic mineralogy and chemistry, including generally high silica, alumina:alkalis*1.1, relatively low sodium and *1% CIPW normative corundum; implied to originate from sedimentary or supracrustal source rocks.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012572, 146);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013278, 'diagenesis', NULL, 'Any chemical, physical or biological process undergone by a sediment after deposition, and during and after lithification; excludes weathering and metamorphism.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 432);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013279, 'diastrophism', NULL, 'Those movements that result directly or indirectly in relative or absolute changes of position, level or attitude of rocks forming the earth*s crust; includes uplift and faulting.', 'earth movements', '2007-11-15 00:00:00', NULL, 167916112856012594, 431);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013280, 'shearing', NULL, 'Any process that causes contiguous parts of a rock mass to slide relatively to each other in a direction parallel to their plane of contact.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 430);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013281, 'folding', NULL, 'Any process that causes bending or curving of planar structures in a rock mass, to form folds.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 429);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013282, 'faulting', NULL, 'Any process that causes separate rock masses to slide past one another along a discrete surface or zone of discrete surfaces.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 428);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013283, 'horizontal extension', NULL, 'Any process that increases the length of a rock volume in a given horizontal plane.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 427);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013284, 'ductile deformation', NULL, 'Any process that causes a rock to deform by continuous flow.', 'plastic deformation', '2007-11-15 00:00:00', NULL, 167916112856012594, 426);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013285, 'horizontal shortening', NULL, 'Any process that reduces the length of a rock volume in a given horizontal plane.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 425);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013286, 'brittle-ductile deformation', NULL, 'Any process that causes a rock to deform in both brittle and ductile fashions.', NULL, '2007-11-12 00:00:00', NULL, 167916112856012594, 424);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013287, 'brittle deformation', NULL, 'Any process that causes a rock to deform by fracturing, rather than continuous flow.', 'cataclastic deformation', '2007-11-12 00:00:00', NULL, 167916112856012594, 423);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013288, 'deformation', NULL, 'General term for the process of folding, faulting, shearing, compression or extension of rocks as a result of various Earth forces.', NULL, '2007-11-12 00:00:00', NULL, 167916112856012594, 422);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013289, 'magmatic crystallisation', NULL, 'The process by which magma-derived material becomes crystalline in an igneous intrusion.', NULL, '2007-11-12 00:00:00', NULL, 167916112856012594, 421);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013290, 'crystallisation', NULL, 'The process by which matter becomes crystalline from a gaseous, fluid or dispersed state.', 'crystallization', '2007-11-12 00:00:00', NULL, 167916112856012594, 420);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013291, 'cooling', NULL, 'Any process that causes a decrease in temperature of a rock body.', NULL, '2007-11-12 00:00:00', NULL, 167916112856012594, 419);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013292, 'Aptian', NULL, 'The second-youngest age of the Early Cretaceous Epoch in the Standard Global Chronostratigraphic Scale.', NULL, '2007-11-12 00:00:00', NULL, 167916112856012591, 1680);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013293, 'Albian', NULL, 'The youngest age of the Early Cretaceous Epoch in the Standard Global Chronostratigraphic Scale.', NULL, '2007-11-12 00:00:00', NULL, 167916112856012591, 1679);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013296, 'genesis', NULL, 'A relationship in time between two concepts where one has been generated from the other, such as in metamorphism.', NULL, '2007-11-10 00:00:00', NULL, 167916112856012560, 416);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013297, 'is younger than', NULL, 'The younger concept in a temporal relationship.', NULL, '2007-11-10 00:00:00', NULL, 167916112856012556, 415);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013298, 'is older than', NULL, 'The older concept in a temporal relationship.', NULL, '2007-11-10 00:00:00', NULL, 167916112856012556, 414);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013299, 'temporal', NULL, 'A relationship in time between two concepts.', NULL, '2007-11-10 00:00:00', NULL, 167916112856012560, 413);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013300, 'equivalent to [facies equivalency]', NULL, 'A facies that formed at the same time as another facies.', NULL, '2007-11-10 00:00:00', NULL, 167916112856012557, 412);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013301, 'equivalent to [equivalency]', NULL, 'A Geological Unit or Earth Material that is stratigraphically equivalent to another Geological Unit or Earth Material.', NULL, '2007-11-10 00:00:00', NULL, 167916112856012557, 411);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013302, 'underlies [disconformable]', NULL, 'The concept that is stratigraphically below the disconformity.', NULL, '2007-11-10 00:00:00', NULL, 167916112856012557, 410);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013303, 'overlies [disconformable]', NULL, 'The concept that is stratigraphically above the disconformity.', NULL, '2007-11-10 00:00:00', NULL, 167916112856012557, 409);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013304, 'correlates with [stratigraphic]', NULL, 'A Geological Unit or Earth Material that corresponds in character and stratigraphic position to another.', NULL, '2007-11-10 00:00:00', NULL, 167916112856012557, 408);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1679161121580275456, 'FreshColour', 'FreshColour', 'FreshColour', NULL, '2006-12-18 00:00:00', NULL, 1679161121580275191, 6);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013305, 'underlies [conformable]', NULL, 'The concept that is stratigraphically below the conformity.', NULL, '2007-11-10 00:00:00', NULL, 167916112856012557, 407);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013306, 'overlies [conformable]', NULL, 'The concept that is stratigraphically above the conformity.', NULL, '2007-11-10 00:00:00', NULL, 167916112856012557, 406);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013307, 'grades laterally into [intrusive]', NULL, 'A Geological Unit or Earth Material that grades laterally into another.', NULL, '2007-11-10 00:00:00', NULL, 167916112856012558, 405);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013308, 'is intruded by', NULL, 'The Earth Material that is injected by another Earth Material.', 'hosts', '2007-11-10 00:00:00', NULL, 167916112856012558, 404);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013309, 'intrudes', NULL, 'The unlithified Earth Material that injects into another Earth Material.', 'intrusion', '2007-11-10 00:00:00', NULL, 167916112856012558, 403);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013310, 'facies equivalency', NULL, 'A relationship between Geological Units or Earth Materials with differing lithologic or biologic aspects (different facies) that formed at the same time.', NULL, '2007-11-10 00:00:00', NULL, 167916112856012561, 402);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013311, 'equivalency [stratigraphic]', NULL, 'A relationship between Geological Units or Earth Materials that correspond in stratigraphic position.', NULL, '2007-11-10 00:00:00', NULL, 167916112856012561, 401);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013312, 'disconformable', NULL, 'A disconformable relationship between Geological Units or Earth Materials.', NULL, '2007-11-10 00:00:00', NULL, 167916112856012561, 400);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013313, 'correlation [stratigraphic]', NULL, 'A relationship between Geological Units or Earth Materials that show correspondence in character and stratigraphic position.', NULL, '2007-11-10 00:00:00', NULL, 167916112856012561, 399);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013314, 'conformable', NULL, 'A conformable relationship between Geological Units or Earth Materials.', NULL, '2007-11-10 00:00:00', NULL, 167916112856012561, 398);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013315, 'lateral gradation [intrusive]', NULL, 'An intrusive relationship where a Geological Unit or Earth Material grades into another.', NULL, '2007-11-10 00:00:00', NULL, 167916112856012562, 397);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013316, 'intrusive', NULL, 'The forcible emplacement of one Earth Material or Geological Unit into another, especially magma into a host.', NULL, '2007-11-10 00:00:00', NULL, 167916112856012562, 396);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013317, 'cooling column', NULL, 'A column of rock formed by the intersection of columnar joint sets during cooling of an igneous rock.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012582, 395);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013318, 'lava flow [morphology]', NULL, 'A tabular body formed by lateral surficial outpouring of molten lava from a vent or fissure.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012582, 394);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013319, 'screen', NULL, 'A vertically extensive body of country rock separating two intrusions or phases of an intrusion.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012582, 393);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013320, 'stream bank', NULL, 'Very short, very wide slope, moderately inclined to precipitous, forming the marginal upper parts of a stream channel; resulting from erosion or aggradation by channelled stream flow.', 'bank', '2007-11-09 00:00:00', NULL, 167916112856012583, 392);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013321, 'backplain', NULL, 'Large flat resulting from aggradation by overbank stream flow at some distance from the stream channel, and in some cases biological (peat) accumulation; often characterised by a high water table and the presence of swamps or lakes.', NULL, '2007-11-09 00:00:00', NULL, 167916112856012583, 391);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013322, 'reef construction', NULL, 'The building of a reef structure by sedentary calcareous organisms, especially corals.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012594, 390);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013323, 'alcove', NULL, 'Moderately inclined to very steep, short open depression with concave cross section; eroded by collapse, landslides, creep or surface wash.', NULL, '2007-11-09 00:00:00', NULL, 167916112856012583, 389);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013324, 'apophysis', NULL, 'An offshoot from a larger intrusive body.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012582, 388);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013325, 'cupola', NULL, 'A large upward projection of the roof of an igneous intrusion into the country rock above.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012582, 387);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013326, 'sheet', NULL, 'A tabular intrusion, concordant or slightly discordant.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012582, 386);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013327, 'stock', NULL, 'A small, roughly equidimensional, discordant magma body with exposed surface area of less than 2km square.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012582, 385);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013328, 'sill', NULL, 'A tabular igneous intrusion that parallels the bedding or foliation of the country rock.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012582, 384);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013329, 'pipe', NULL, 'A vertical conduit through the Earth*s crust below a volcano, through which magmatic materials have passed; represents the upper part of the conduit connecting the volcanic vent with the underlying magma source.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012582, 383);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013330, 'igneous fissure', NULL, 'A volcanic conduit having the form of a crack or fissure.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012582, 382);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013331, 'cone sheet', NULL, 'An arcuate dyke that dips 30-45 degrees towards the centre of the arc; occur in concentric sets, presumably converging at a magmatic centre.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012582, 381);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013332, 'ring dyke', NULL, 'An arcuate or subcircular dyke, generally associated with a volcanic centre.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012582, 380);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013333, 'ring complex', NULL, 'An association of ring dykes and cone sheets.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012582, 379);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013334, 'dyke', NULL, 'A discordant, vertical or steeply dipping tabular igneous intrusion; produced when magma is injected along fractures in host rock.', 'dike', '2007-11-04 00:00:00', NULL, 167916112856012582, 378);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013335, 'dyke swarm', NULL, 'A concentration of dykes.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012582, 377);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (2010, 'ERA1', 'ERA1 ABBREVATION', 'ERA DESCRIPTION1', 'ERA1GUSSYNONYM', '2006-12-12 00:00:00', NULL, 2001, 1);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013336, 'lopolith', NULL, 'A large, concordant, typically layered igneous intrusion whose floor is convex-down and whose roof may be convex-down or flat; spoon-like shape.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012582, 376);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013337, 'ethmolith', NULL, 'A discordant, funnel-shaped pluton that tapers downward.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012582, 375);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013338, 'akmolith', NULL, 'An intrusion along a decollement zone, with or without tonguelike extensions into the surrounding rock.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012582, 374);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013339, 'cactolith', NULL, 'An obscurely cactus-shaped intrusion.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012582, 373);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013340, 'sphenolith', NULL, 'A wedge-like intrusion that is partly concordant and partly discordant.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012582, 372);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013341, 'ductolith', NULL, 'A concordant  intrusion that is teardrop-shaped in cross section.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012582, 371);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013342, 'chonolith', NULL, 'A pluton so irregular as to defy description.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012582, 370);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971447769304, 'SW', NULL, 'SW', NULL, '2008-02-24 00:00:00', NULL, 1677736971447769074, 1166);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012813, 'pink [general]', NULL, 'A light tint of red, crimson or reddish purple.', NULL, '2007-11-16 00:00:00', NULL, 167916112856012554, 584);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013343, 'harpolith', NULL, 'A phacolith with a vertical axis; indicates multiple deformations.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012582, 369);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013344, 'phacolith', NULL, 'A concordant, lenticular intrusion emplaced along a fold axis.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012582, 368);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013345, 'laccolith', NULL, 'A concordant, flat-based, convex-up intrusion; shaped like a mushroom.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012582, 367);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013346, 'contact metamorphic', NULL, 'The area of solid-state recrystallisation of country rock adjacent to a magma chamber.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012568, 366);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013347, 'contourite drift', NULL, 'An environment where bottom (contour) currents create bedforms at a range of scales.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012564, 365);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013348, 'abyssal plain [environment]', NULL, 'A basin plain on true ocean floor where the abyssal hills have been largely submerged by infilling of the deeper areas.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012564, 364);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013349, 'basin plain', NULL, 'A flat, relatively deep area of low relief; smoothed and buried by turbidite fill.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012564, 363);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013350, 'slope apron [deep sea]', NULL, 'The area between the shelf or land and the basin floor; distinguished from submarine ramps in that they are fed from an essentially linear continuous source.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012564, 362);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013351, 'submarine ramp', NULL, 'All broad constructional areas of deep sea slopes and base of slopes with multiple sources of sediment in the upslope region.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012564, 361);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013352, 'submarine fan', NULL, 'Distinctive constructional feature on the sea floor that developed seaward of a major sediment point source, such as a river, delta or glacial tongue.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012564, 360);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013353, 'hemipelagic', NULL, 'Deep sea environment where sediment is composed of fine grained terrigenous material and biogenic debris settled out from the water column; biogenic component may be up to 75%.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012564, 359);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013354, 'pelagic', NULL, 'Deep sea environment where the majority of sediment is supplied by biogenic debris from the water column; less than 25% terrigenous material.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012564, 358);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013356, 'offshore', NULL, 'The deeper water area of a carbonate platform away from the shoreline, such as the base of the ramp.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012564, 356);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013357, 'rimmed shelf', NULL, 'A shallow water, land-attached carbonate platform with a pronounced break in slope into deeper water; wave agitated zone is at the shelf break.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012564, 355);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013358, 'ramp', NULL, 'A gently sloping carbonate platform, typically less than one degree; wave agitated zone is near the shore.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012564, 354);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013359, 'reef mound', NULL, 'A reef constructed by organisms that lack significant frame-building potential.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012564, 353);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013360, 'patch reef', NULL, 'An isolated reef formed in shallow water, such as the platform interior or inner ramp.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012564, 352);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013361, 'backreef lagoon', NULL, 'The lagoon environment behind a reef.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012564, 351);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013362, 'sand apron', NULL, 'The area that extends from the pavement into the platform interior.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012564, 350);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013363, 'pavement', NULL, 'The area of the reef flat adjacent to the crest; commonly exposed during very low tides.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012564, 349);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013364, 'reef flat', NULL, 'The area of the reef behind the crest; composed of the pavement and sand apron.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012564, 348);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013365, 'reef crest', NULL, 'The highest point on a reef.', NULL, '2007-11-04 00:00:00', NULL, 167916112856012564, 347);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013366, 'reef front', NULL, 'The area of a reef between the crest and the point where frame construction ceases.', NULL, '2007-11-03 00:00:00', NULL, 167916112856012564, 346);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013367, 'forereef', NULL, 'The area of slope that extends from the reef front to the basin floor.', NULL, '2007-11-03 00:00:00', NULL, 167916112856012564, 345);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013368, 'reef complex', NULL, 'Typically large reef tract, such as those that develop at rimmed shelf margins.', NULL, '2007-11-03 00:00:00', NULL, 167916112856012564, 344);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013369, 'reef', NULL, 'A carbonate platform built up by biological carbonate accumulation.', NULL, '2007-11-03 00:00:00', NULL, 167916112856012564, 343);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013370, 'base-of-slope apron', NULL, 'The area of sediment accumulation at the base of a steep slope next to a carbonate platform; sediment bypasses the upper slope.', NULL, '2007-11-03 00:00:00', NULL, 167916112856012564, 342);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1679161121580275462, 'Worksite', 'Worksite', 'Worksite', NULL, '2006-12-18 00:00:00', NULL, 1679161121580275192, 2);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013371, 'slope apron [carbonate platform]', NULL, 'Carbonate platform slope environment with a relatively gentle slope (*4 degrees); continuous with the shallow-water platform margin which supplies their sediment.', NULL, '2007-11-03 00:00:00', NULL, 167916112856012564, 341);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013373, 'slope [carbonate platform]', NULL, 'The transitional area adjacent to a high-relief, steep sided carbonate platform; may be a few degrees slope to almost vertical.', NULL, '2007-11-03 00:00:00', NULL, 167916112856012564, 339);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013374, 'supratidal [carbonate platform]', NULL, 'The shore area of a carbonate platform just above high tide level.', NULL, '2007-11-03 00:00:00', NULL, 167916112856012564, 338);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013375, 'intertidal [carbonate platform]', NULL, 'The benthic ocean environment between high water and low water.', NULL, '2007-11-03 00:00:00', NULL, 167916112856012564, 337);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013376, 'subtidal [carbonate platform]', NULL, 'The area of a carbonate platform below the low tide level.', NULL, '2007-11-03 00:00:00', NULL, 167916112856012564, 336);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013377, 'shoreline [carbonate platform]', NULL, 'The area of a carbonate platform extending from the highest storm or spring tide, to somewhat below the lowest tide.', 'peritidal', '2007-11-03 00:00:00', NULL, 167916112856012564, 335);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013378, 'platform interior [high energy]', NULL, 'The high energy subtidal to intertidal environment in a carbonate platform interior.', NULL, '2007-11-03 00:00:00', NULL, 167916112856012564, 334);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013379, 'platform interior [low energy]', NULL, 'The area of a carbonate platform that includes shelf lagoons, back-barrier or back-reef lagoons, embayments, beaches and tidal flat environments.', NULL, '2007-11-03 00:00:00', NULL, 167916112856012564, 333);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013380, 'slate belt', NULL, 'Typically narrow zone of slate parallel to orogenic belts (exception: equidimensional slate belt in N Wales).', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 235);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013381, 'Archean greenstone belt', NULL, 'Volcanic mainly subaqueous basalt + komatiite-dominated successions formed in arcs, submarine plateaux, volcanic islands + oceanic crust, mainly juvenile oceanic terranes.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 234);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013382, 'ophiolite', NULL, 'Tectonically emplaced layered oceanic crust fragment; ideal sequence from the base is ultramafic tectonite, commonly harzburgite; cumulate gabbros+ ultramafics; non-cumulate gabbros diorites + plagiogranites; sheeted diabase dykes; pillow basalts.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 233);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013383, 'nappe', NULL, 'Allochthonous region of large-scale thrusting with or without recumbent folding of rocks of essentially horizontal undisturbed material.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 232);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013384, 'hinterland plateau', NULL, 'Area elevated 1 to 5 km adjacent to the suture zone in the near hinterland of a fold thrust belt.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 231);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013385, 'hinterland', NULL, 'The side of a thrust belt away from which the thrust sheets move.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 230);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013386, 'foreland flexure', NULL, 'Upwarped lithosphere area ahead of major overthrust belts.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 229);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013387, 'piggyback basin', NULL, 'Basin formed and carried atop moving thrust sheets.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 228);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013388, 'foreland intermontane basin', NULL, 'Basin formed among basement-cored uplifts in a foreland setting.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 227);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013389, 'foreland', NULL, 'The side of a thrust belt toward which the thrust sheets move.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 226);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013390, 'flysch', NULL, 'Deep marine clastic sediments deposited early in the orogenic history of a fold belt, commonly in an accretionary wedge or a passive continental margin.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 225);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013391, 'molasse', NULL, 'Coarse grained shallow marine to terrestrial sediments deposited in foreland basins as a result of erosion of actively uplifting mountain ranges.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 224);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013392, 'fold-thrust belt', NULL, 'Belt of deformed rocks dominated by thrust faults and thrust-related folds, usually of low metamorphic grade.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 223);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013393, 'external zone', NULL, 'Zone of low or no metamorphic grade and relatively simple structure on the outer part of a fold belt.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 222);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013394, 'successor basin', NULL, 'Basin formed in intermontane setting following cessation of local orogenic or taphrogenic activity.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 221);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013395, 'suture zone', NULL, 'Fault or shear zone separating two different plates with different geological histories, often marked by ophiolites.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 220);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013396, 'regional metamorphic complex', NULL, 'Zone of complexly deformed rocks that have undergone medium to high grade regional metamorphism, with or without granitic intrusions.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 219);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013397, 'internal zone', NULL, 'Zone of regional metamorphism and complex deformation in the core of a fold belt.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 218);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013398, 'collision zone', NULL, 'Zone where two bouyant plates have converged on each other to form a fold belt.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 217);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971447769305, 'very coarse sand', NULL, '1 - 2mm.', NULL, '2008-02-22 00:00:00', NULL, 1677736971447769072, 1076);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013399, 'collisional orogen', NULL, 'Orogen formed by collision of two or more continental units commonly greatly thickening and partially melting the crust with extensive thrusting, folding, metamorphism and mountain formation.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 216);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1679161121580275457, 'WeatherringCharacter', 'WeatherringCharacter', 'WeatherringCharacter', NULL, '2006-12-18 00:00:00', NULL, 1679161121580275191, 5);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013400, 'accretionary orogen', NULL, 'Orogen formed by collision and suturing of largely juvenile crustal blocks such as ophiolites, island arcs and submarine plateaux with little reworked older crust.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 215);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013401, 'orogen', NULL, 'Linear or arcuate region that has been subjected to folding and other deformation during an orogenic cycle.', 'fold beltorogenic belt', '2007-11-02 00:00:00', NULL, 167916112856012593, 214);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013402, 'convergent plate boundary', NULL, 'A boundary between two plates that are moving toward each other.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 213);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013403, 'core complex', NULL, 'Domelike exposure of the metamorphosed mylonitic footwall of the regional detachment fault beneath a wide continental rift.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 212);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013404, 'sheeted dykes', NULL, 'A swarm of parallel or subparallel igneous dykes so closely spaced that little or no intervening rock is preserved.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 211);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013405, 'proto-oceanic rift', NULL, 'Incipient oceanic basin floored by new oceanic crust and flanked by young rifted continental margins.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 210);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013406, 'rift', NULL, 'Central fault-bounded valley running along slow spreading ridges.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 209);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013407, 'mid-ocean ridge', NULL, 'A continuous, seismic, median mountain range; a broad, fractured swell with a central rift valley and usually extremely rugged topography.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 208);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013408, 'aulacogen', NULL, 'A sediment-filled continental rift that trends at a high angle to the adjacent continental margin or orogen.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 207);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013409, 'continental rift basin', NULL, 'Sediment fill of a continental rift valley, commonly associated with bimodal volcanism.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 206);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013410, 'divergent plate boundary', NULL, 'A boundary between two plates that are moving away from each other.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 205);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013411, 'triple junction', NULL, 'Point where three plates join.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 204);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013412, 'plate boundary', NULL, 'Zone of seismic and tectonic activity along the edges of lithosphere plates.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 203);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013413, 'block-faulted region', NULL, 'System of approx parallel faults with dip-slip displacements of 100s or 1000s of metres.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 202);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013414, 'salt dome', NULL, 'Region of diapiric uprise of thick columnar plug-like body of halite or gypsum.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 201);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971447769342, 'gibbsite', 'Gbs', NULL, NULL, '2008-05-15 00:00:00', NULL, 1677736971447769088, 1307);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013415, 'upper plate margin', NULL, 'Passive margin developed on the hangingwall of a low-dipping detachment fault that penetrates the lithosphere during asymmetric rifting of continental crust.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 200);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013416, 'lower plate margin', NULL, 'Passive margin developed on the footwall of a low-dipping detachment fault that penetrates the lithosphere during asymmetric rifting of continental crust.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 199);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013418, 'rise', NULL, 'The part of the continental margin between the continental slope and the abyssal plain; gentle incline and generally smooth topography, although it may bear submarine canyons.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 197);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013419, 'slope [passive continental margin]', NULL, 'The part of the continental margin between the shelf and the continental rise if there is one; relatively steep slope (3-6 degrees).', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 196);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013420, 'shelf', NULL, 'The part of the continental margin between the shoreline and the continental slope, or 200m depth in the absence of a noticeable continental slope; characteristic very gentle slope (approx. 0.1 degree).', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 195);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013421, 'passive continental margin', NULL, 'A continental boundary formed by rifting and continental rupture.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 194);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013422, 'giant linear dyke swarm', NULL, 'Zones to 500 km wide and 3000 km long containing thousands of parallel tholeiitic dykes to 200 m thick and to 1000 km long which are intruded laterally and widen sufacewards.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 193);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013423, 'giant radial dyke swarm', NULL, 'Zones to 500 km wide and 3000 km long containing thousands of tholeiitic dykes to 200 m thick and to 1000 km long which are intruded laterally and widen sufacewards, radiating from a point.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012593, 192);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013424, 'carbonate platform', NULL, 'A shallow marine platform characterised by the presence of thick carbonates.', NULL, '2007-11-03 00:00:00', NULL, 167916112856012564, 332);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013425, 'shallow clastic sea', NULL, 'The rim around a continent between the shoreline and the slope; generally less than 200m deep, with gentle gradients (0.1 - 1degree) and normal marine salinities.', 'shelf', '2007-11-03 00:00:00', NULL, 167916112856012564, 331);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013426, 'arid basin', NULL, 'A marine basin area where the rate of evaporation exceeds precipitation.', NULL, '2007-11-03 00:00:00', NULL, 167916112856012564, 330);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013427, 'coastal salina', NULL, 'Formed in a salt lake near the coast; may be perennial, ephemeral or dessicated (rarely flooded, kept moist by inflowing groundwater).', NULL, '2007-11-03 00:00:00', NULL, 167916112856012564, 329);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013428, 'coastal sabkha', NULL, 'Low-lying, salt-encrusted surfaces near the coast, sometimes adjacent to perennial or ephemeral bodies of brine.', NULL, '2007-11-03 00:00:00', NULL, 167916112856012564, 328);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013429, 'arid shoreline', NULL, 'An area of coast where evaporation loss exceeds precipitation.', NULL, '2007-11-03 00:00:00', NULL, 167916112856012564, 327);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1679161121580275458, 'Induration', 'Induration', 'Induration', NULL, '2006-12-18 00:00:00', NULL, 1679161121580275191, 4);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013430, 'supratidal  [siliciclastic coast]', NULL, 'The shore area just above high tide level.', NULL, '2007-11-03 00:00:00', NULL, 167916112856012565, 326);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013431, 'intertidal  [siliciclastic coast]', NULL, 'The benthic ocean environment between high water and low water.', NULL, '2007-11-03 00:00:00', NULL, 167916112856012565, 325);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013432, 'subtidal  [siliciclastic coast]', NULL, 'The area of a shoreline below the low tide level.', NULL, '2007-11-03 00:00:00', NULL, 167916112856012565, 324);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013433, 'shoreline [siliciclastic coast]', NULL, 'The area of a shoreline extending from the highest storm or spring tide, to somewhat below the lowest tide.', 'peritidal', '2007-11-03 00:00:00', NULL, 167916112856012565, 323);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013434, 'estuary', NULL, 'A semi-enclosed coastal body of water which has a free connection with the open sea, within which the sea water is measurably diluted with land-derived fresh water.', NULL, '2007-11-03 00:00:00', NULL, 167916112856012565, 322);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013435, 'barrier island and lagoon', NULL, 'An area of coast with a barrier island separated from the land by a shore-parallel lagoon.', NULL, '2007-11-03 00:00:00', NULL, 167916112856012565, 321);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013436, 'tidal flat [environment]', NULL, 'A stretch of shoreline in a tidal setting; tidal flats have an antithetic relationship with beaches.', NULL, '2007-11-03 00:00:00', NULL, 167916112856012565, 320);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013437, 'chenier plain [environment]', NULL, 'An area of extensive coastal mudflats with widely separated, subparallel beach ridges (cheniers), commonly composed of sand; cheniers rest on a silt or clay substrate and are isolated from the shore by a belt of tidal mudflats.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012565, 319);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013438, 'beach-ridge strandplain [environment]', NULL, 'A wave-dominated, sand-rich shoreline attached to the land, with both a strandplain and a beach-shoreface.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012565, 318);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013439, 'coastal plain [environment]', NULL, 'The area of extremely low relief near a shoreline.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012565, 317);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013440, 'non-deltaic siliciclastic coast', NULL, 'A coast where sand, silt and mud predominate, rather than gravel, and where direct fluvial input is insignificant.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012565, 316);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013441, 'prodelta', NULL, 'The part of a delta that is below the effective depth of wave erosion, between the delta front and the floor of the basin.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012565, 315);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013442, 'delta front', NULL, 'The narrow area of most active deposition in a delta within the effective depth of water erosion (*10m); the zone that separates the delta plain and the prodelta.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012565, 314);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013443, 'tidal dominated delta', NULL, 'A delta whose form is largely controlled by tides.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012565, 313);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013444, 'waves dominated delta', NULL, 'A delta whose form is largely modified by wave action.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012565, 312);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013445, 'delta plain', NULL, 'The extensive lowland area of active and abandoned distributary channels and associated levees, separated by emergent or near-emergent areas.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012565, 311);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013446, 'fluvial dominated delta', NULL, 'A delta dominated by fluvial processes.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012565, 310);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013447, 'river delta', NULL, 'The generally flat, fan-shaped area at or near the mouth of a river.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012565, 309);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013448, 'coarse-grained gravel-rich coast', NULL, 'An area of fan deltas, braidplain deltas, braid deltas or gravel beaches, with a direct linkage between the alluvial feeder system, the shoreline and the receiving basin, even the deepwater portion.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012565, 308);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013449, 'rocky coast', NULL, 'An erosional shoreline where retreating bedrock cliffs leave behind erosional features such as headlands, sea stacks and wave-cut rock platforms.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012565, 307);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013450, 'clastic coast', NULL, 'Formed at or near a coastline dominated by clastic sedimentary processes.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012565, 306);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (2011, 'ERA2', 'ERA2 ABBREVATION', 'ERA DESCRIPTION2', 'ERA2GUSSYNONYM', '2006-12-12 00:00:00', NULL, 2001, 2);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013451, 'marine', NULL, 'Formed in the sea, ie. from somewhat below the low tide line through to the deepest water.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012564, 305);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013452, 'coastal', NULL, 'The areas near the boundary between the land and the sea.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012565, 304);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971447769307, 'gravel', NULL, 'Greater than 2mm.', NULL, '2008-02-22 00:00:00', NULL, 1677736971447769072, 1077);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013453, 'periglacial zone', NULL, 'Formed near a glacier, where the cold temperature of the ice and frost action is an important influence.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012566, 303);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013454, 'glaciomarine', NULL, 'Formed in the area of interaction between a glacier and the sea, or by the combined action of glaciers and the sea.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012566, 302);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013455, 'glaciolacustrine', NULL, 'Formed in a glacial lake.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012566, 301);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013456, 'glaciofluvial', NULL, 'Formed in areas of accumulation as a result of the action of meltwater streams flowing from wasting glacier ice, or the combined action of glaciers and streams.', 'fluvioglacial', '2007-11-02 00:00:00', NULL, 167916112856012566, 300);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013457, 'ice-contact proglacial zone', NULL, 'The area immediately in front of a glacier or just beyond the outer limits of an ice sheet.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012566, 299);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013458, 'supraglacial zone', NULL, 'The top surface of a glacier or ice sheet.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012566, 298);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013459, 'glacial', NULL, 'Formed in or near, and due to the action of, ice or glaciers.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012566, 297);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013460, 'lunette [environment]', NULL, 'Formed in the cresent-shaped dune on the downwind side of an ephemeral lake.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012566, 296);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013461, 'playa', NULL, 'Formed in a dry, vegetation-free flat area in the lowest part of an undrained desert basin.', 'salina', '2007-11-02 00:00:00', NULL, 167916112856012566, 295);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013462, 'dunefield [environment]', NULL, 'Formed in an area of extensive sand dunes with abundant sediment supply.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012566, 294);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013463, 'wadi', NULL, 'A steep-sided, bouldery stream bed or channel that is usually dry except during the rainy season, and that often forms an oasis.', 'arroyo', '2007-11-02 00:00:00', NULL, 167916112856012566, 293);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013464, 'sabkha', NULL, 'A flat area where saline minerals crystallise at or near the surface through deflation and evaporation.', 'sabkhah;sebkha', '2007-11-02 00:00:00', NULL, 167916112856012566, 292);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013465, 'aeolian [environment]', NULL, 'Formed in an area of accumulation of material transported by the wind.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012566, 291);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013466, 'delta', NULL, 'Formed in the area of accumulation in a river delta extending into a lake.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012566, 290);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013467, 'beach [lacustrine]', NULL, 'Formed in the area around a lake shore.', 'nearshore', '2007-11-02 00:00:00', NULL, 167916112856012566, 289);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013469, 'regolith', NULL, 'Formed in the near surface environment and as a result of by the physical, chemical and biological interactions in that environment; pertaining to all unconsolidated materials above bedrock.', 'palaeosol', '2007-11-02 00:00:00', NULL, 167916112856012566, 287);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013470, 'swamp/marsh/bog', NULL, 'Formed in an area of low, permanently or intermittently waterlogged ground.', 'swamp;marsh;bog', '2007-11-02 00:00:00', NULL, 167916112856012566, 286);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013472, 'colluvial', NULL, 'Formed in an area of accumulation due to rainwash, sheetwash, or slow creep of sediment down a slope.', NULL, '2007-11-02 00:00:00', NULL, 167916112856012566, 284);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013473, 'combustion metamorphism', NULL, 'Metamorphism of local extent produced by the spontaneous combustion of naturally occurring substances such as bituminous rocks, coal or oil.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 500);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013474, 'hot-slab metamorphism', NULL, 'Metamorphism of local extent occurring beneath an emplaced hot tectonic body.', 'hot slab metamorphism', '2007-11-15 00:00:00', NULL, 167916112856012594, 499);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013475, 'impact metamorphism', NULL, 'Metamorphism of local extent caused by impact of a planetary body (projectile or impactor) on a planetary surface (target); includes melting and vaporisation of the target rocks.', 'shock metamorphism', '2007-11-15 00:00:00', NULL, 167916112856012594, 498);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013476, 'dislocation metamorphism', NULL, 'Metamorphism of local extent associated with fault zones or shear zones.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 497);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013477, 'pyrometamorphism', NULL, 'Contact metamorphism characterised by very high temperatures, at very low pressures, generated by a volcanic or subvolcanic body.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 496);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013478, 'contact metamorphism', NULL, 'Metamorphism of local extent that affects the country rocks around a magma body.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 495);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013479, 'hydrothermal metamorphism', NULL, 'Metamorphism of local extent caused by hot H2O-rich fluids.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 494);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013480, 'ocean floor metamorphism', NULL, 'Metamorphism of regional or local extent related to the steep geothermal gradient occurring near spreading centres in oceanic environments.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 493);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013481, 'burial metamorphism', NULL, 'Metamorphism mostly of regional extent, which affects rocks deeply buried within a sedimentary-volcanic pile; typically not associated with deformation or magmatism.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 492);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012626, 'trace', NULL, 'Component constitutes less than 5 percent of the volume of the EarthMaterial.', 'sparse', '2007-12-09 00:00:00', NULL, 167916112856012526, 875);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013483, 'metamorphism', NULL, 'Mineralogical, chemical and/or structural adjustment of solid rocks to physical and chemical conditions which differ from the conditions under which the rocks originated.', 'metamorphic', '2007-11-15 00:00:00', NULL, 167916112856012594, 490);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013484, 'intrusion [process]', NULL, 'The process of emplacement of magma into pre-existing rock.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 489);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013485, 'zeolitic alteration', 'ZEOL', 'Introduction of, or replacement by, minerals which have zeolites as distinctive gangue minerals; associated with alteration minerals which include adularia, prehnite, pumpellyite and minerals of the propylitic facies, particularly epidote, albite, and carbonates.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 488);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013486, 'tourmaline alteration', 'TURM', 'Introduction of, or replacement by, tourmaline as pervasive, selectively pervasive and/or vein-controlled alteration.', 'tourmalinization', '2007-11-15 00:00:00', NULL, 167916112856012594, 487);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013487, 'talc alteration', 'TALC', 'Alteration of Mg silicates (eg. olivine, pyroxene and amphibole) or reaction of Mg and silica to form talc; common assoc. minerals are chlorite, dolomite, tremolite, anthophyllite, antigorite (and other serpentine group minerals), magnesite, magnetite and chromite.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 486);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013488, 'scapolite alteration', 'SCAP', 'Alteration involving the introduction of, or replacement by, scapolite.', 'scapolitization', '2007-11-15 00:00:00', NULL, 167916112856012594, 485);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013591, 'slightly indurated', NULL, 'Rock can be broken with single blow from standard rock hammer (* 1 kg mass).', NULL, '2007-10-28 00:00:00', NULL, 167916112856012586, 101);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299232, 'faulted relationship (unit/structure)', NULL, 'Geological Unit or Earth Material disrupted by a discrete surface or zone along which one side has moved relative to the other.', NULL, '2008-05-22 00:00:00', NULL, 1677736972070299358, 1539);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299233, 'blastomylonite', NULL, 'Mylonitic rock in which porphyroblasts have grown, and strained grains have annealed; grain growth is pronounced compared to tectonic grainsize reduction.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1538);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013490, 'sodic alteration', NULL, 'Alteration that involves a bulk increase in the sodium content of a rock body; typical mineral assemblage is albite-magnetite-actinolite.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 483);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299234, 'is sheared by', NULL, 'Geological Unit or Earth Material that has been sheared by some agent.', NULL, '2008-05-22 00:00:00', NULL, 1677736972070299361, 1545);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013492, 'silicification', 'SILI', 'Introduction of, or replacement by, silica, generally resulting in fine-grained quartz, chalcedony or opaline silica (opal), which may fill pores and replace existing minerals.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 481);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971447769302, 'W', NULL, 'W', NULL, '2008-02-24 00:00:00', NULL, 1677736971447769074, 1168);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013493, 'serpentinisation', 'SERP', 'Conversion or replacement of magnesium-rich silicate minerals (e.g., olivine, pyroxenes, and/or amphiboles) by serpentine group minerals, including antigorite, chrysotile, brucite, talc, magnetite, and magnesite (carbonates).', 'serpentinization', '2007-11-15 00:00:00', NULL, 167916112856012594, 480);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013494, 'rodingitization', 'RDGZ', 'Metasomatic alteration to rodingite, a massive dense calc-silicate rock typically rich in grossular garnet and diopside; accessory minerals include combinations of clinozoisite, zoisite, vesuvianite, chlorite, prehnite and serpentine.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 479);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013495, 'pyrite alteration', 'PYRT', 'Introduction of, or replacement by, pyrite.', 'pyritic alteration;pyritization;pyritisation', '2007-11-15 00:00:00', NULL, 167916112856012594, 478);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013496, 'propylitic alteration', 'PROP', 'Assemblage consists of epidote, chlorite, zoisite, clinozoisite, sericite, Mg-Fe-Ca carbonates, pyrite and sometimes albite-orthoclase, all involved in partial replacement of wallrock minerals; hematite, jarosite, and goethite also common.', 'propylitization;propylitisation', '2007-11-15 00:00:00', NULL, 167916112856012594, 477);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013497, 'sericitic alteration', 'SERI', 'Introduction of, alteration to, or replacement by sericitic muscovite; characteristic mineral assemblage of sericite-quartz-pyrite.', 'phyllic alteration;sericitization', '2007-11-15 00:00:00', NULL, 167916112856012594, 476);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013498, 'alunitic alteration', 'ALUN', 'Introduction of, or replacement by, alunite; most common mineral assemblage is alunite with some form of silica; other minerals present commonly include kaolinite, sericite, diaspore, barite, jarosite, rutile, zunyite, pyrite, and haematite.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 475);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013499, 'potassic alteration', 'KSPA', 'Alteration resulting from potassium metasomatism; characteristic major minerals are K-feldspars (adularia, orthoclase, microcline), biotite or chlorite, sericite and quartz, with common albite, anhydrite, Fe-Mg carbonate and apatite.', 'potassium silicate alteration', '2007-11-15 00:00:00', NULL, 167916112856012594, 474);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013500, 'oxidation', 'OXID', 'Alteration by surface waters and/or reaction with oxygen; the result of oxidation of sulphides and leaching of sulphur and most metals, to leave hydrated iron oxides (rarely sulphates) is a gossan; minerals include limonite and haematite.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 473);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971447769308, 'medium sand', NULL, '0.25 - 0.5mm.', NULL, '2008-02-22 00:00:00', NULL, 1677736971447769072, 1074);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013501, 'magnetite alteration', NULL, 'Introduction of, or replacement by, magnetite.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 472);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013502, 'leaching [hydrothermal alteration]', 'LECH', 'Separation, selective removal, or dissolving-out of soluble constituents from a rock, soil, or orebody by the natural action of percolating water.', NULL, '2007-11-15 00:00:00', NULL, 167916112856012594, 471);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013503, 'haematite alteration', 'HEMT', 'Haematite is the principal mineral; may be granular, specular, or more rarely, earthy; the latter is generally of supergene origin and associated with clay minerals; style of alteration is pervasive, selectively pervasive, and vein-controlled.', 'hematitic alteration;haematitic alteration;hematite alteration', '2007-11-15 00:00:00', NULL, 167916112856012594, 470);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013504, 'flood plain', NULL, 'Alluvial plain characterised by frequently active aggradation by overbank stream flow (i.e. by flooding more often than every 50 years) and erosion by channelled stream flow.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 32);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013505, 'alluvial plain', NULL, 'Level, gently sloping or slightly undulating land surface produced by extensive deposition of alluvium, generally adjacent to a river that periodically overflows its banks.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 31);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013506, 'alluvial landforms', NULL, 'Complex landform pattern on valley floors with active, inactive or relict erosion and aggradation by channelled and over-bank stream flow.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 30);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013507, 'aeolian sheet', NULL, 'Sheet of aeolian material formed when wind moulding of the surface is prevented, either by vegetation or because the sand grains are too coarse.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 29);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013508, 'sand plain', NULL, 'Level landform pattern with extremely low relief, typically without stream channels, aggraded by active wind deposition and rarely active sheet flow.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 28);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013509, 'lunette [landform]', NULL, 'Elongate, gently curved, dune on the margin of a playa; typically with a moderate, wave-modified slope towards the playa and a gentle outer slope.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 27);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013510, 'source bordering dune', NULL, 'Dune formed adjacent to the source of the wind blown material; most commonly a river or floodplain which supplies aeolian sediment during periods of low or no flow.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 26);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299235, 'shears', NULL, 'Agent that has sheared a Geological Unit or Earth Material, eg. Abbacus Orogeny, shearing event 1.', NULL, '2008-05-22 00:00:00', NULL, 1677736972070299361, 1544);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299236, 'is faulted by', NULL, 'Geological Unit or Earth Material that has been faulted by some agent.', NULL, '2008-05-22 00:00:00', NULL, 1677736972070299361, 1543);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299237, 'faults [role]', NULL, 'Agent that has faulted a Geological Unit or Earth Material, eg. Abbacus Orogeny, faulting event 1.', NULL, '2008-05-22 00:00:00', NULL, 1677736972070299361, 1542);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013511, 'parabolic dune', NULL, 'Dune with long, scoop-shaped form that when perfectly developed looks like a parabola in plan; convex in the downwind direction so horns point upwind.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 25);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013512, 'transverse dune', NULL, 'Long narrow sand dune oriented normal to the direction of the prevailing wind; in cross section the windward slope is typically steeper than the lee slope.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 24);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013513, 'longitudinal dune', NULL, 'Long narrow sand dune oriented parallel with the direction of the prevailing wind; in cross section one slope is typically steeper than the other.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 23);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013514, 'dune', NULL, 'Moderately inclined to very steep ridge or hillock of loose, windblown granular material, either bare or covered with vegetation, capable of being moved from place to place by wind but always retaining its own characteristic shape.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 22);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013515, 'parabolic dunefield', NULL, 'Dunefield characterised by dunes with long, scoop-shaped forms; convex in the downwind direction so horns point upwind.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 21);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013516, 'irregular dunefield', NULL, 'Dunefield with a mixture of longitudinal and transverse dunes, as well as other more complicated forms.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 20);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971447769303, 'WSW', NULL, 'WSW', NULL, '2008-02-24 00:00:00', NULL, 1677736971447769074, 1167);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013517, 'transverse dunefield', NULL, 'Dunefield characterised by long narrow sand dunes and wide flat swales; dunes are oriented normal to the direction of the prevailing wind; in cross section the windward slope is typically steeper than the lee slope.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 19);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013518, 'longitudinal dunefield', NULL, 'Dunefield characterised by long narrow sand dunes and wide flat swales; dunes are oriented parallel with the direction of the prevailing wind; in cross section one slope is typically steeper than the other.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 18);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013519, 'dunefield [landform]', NULL, 'Low mounds, ridges, banks, or hills of loose, windblown granular material, either bare or covered with vegetation, capable of being moved from place to place by wind but always retaining their own characteristic shape.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 17);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013520, 'aeolian landforms', NULL, 'Landform pattern built up or locally excavated, eroded or aggraded by wind.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 16);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013521, 'stream bar', NULL, 'Elongated, gently to moderately inclined low ridge built up by channelled stream flow.', 'bar', '2007-11-09 00:00:00', NULL, 167916112856012583, 15);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013522, 'Redesdale and part of Pyalong', NULL, 'Redesdale and part of Pyalong 1:50 000 geological map.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012597, 14);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013524, 'Holocene', NULL, 'The youngest epoch of the Neogene Period in the Standard Global Chronostratigraphic Scale.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012591, 1678);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013526, 'Pliocene', 'Np', 'The second-oldest epoch of the Neogene Period in the Standard Global Chronostratigraphic Scale.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012591, 1676);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013527, 'Miocene', 'Nm', 'The oldest epoch of the Neogene Period in the Standard Global Chronostratigraphic Scale.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012591, 1675);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013528, 'Neogene', 'N', 'The youngest period of the Cenozoic Era in the Standard Global Chronostratigraphic Scale.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012591, 1674);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013529, 'Oligocene', 'Go', 'The youngest epoch of the Paleogene Period in the Standard Global Chronostratigraphic Scale.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012591, 1673);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013530, 'Eocene', 'Ge', 'The middle epoch of the Paleogene Period in the Standard Global Chronostratigraphic Scale.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012591, 1672);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013531, 'Paleocene', 'Gp', 'The oldest epoch of the Paleogene Period in the Standard Global Chronostratigraphic Scale.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012591, 1671);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013532, 'Paleogene', 'G', 'The oldest period of the Cenozoic Era in the Standard Global Chronostratigraphic Scale.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012591, 1670);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013533, 'Cenozoic', 'CZ', 'The youngest era of the Phanerozoic Eon of the Standard Global Chronostratigraphic Scale.', 'Cainozoic', '2007-10-28 00:00:00', NULL, 167916112856012591, 1669);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013534, 'Late Cretaceous', NULL, 'The youngest epoch of the Cretaceous Period in the Standard Global Chronostratigraphic Scale.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012591, 1668);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013535, 'Early Cretaceous', NULL, 'The oldest epoch of the Cretaceous Period in the Standard Global Chronostratigraphic Scale.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012591, 1667);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013536, 'Cretaceous', 'K', 'The youngest period of the Mesozoic Era  in the Standard Global Chronostratigraphic Scale.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012591, 1666);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013537, 'Jurassic', 'J', 'The middle period of the Mesozoic Era  in the Standard Global Chronostratigraphic Scale.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012591, 1665);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013538, 'Triassic', 'R', 'The oldest period of the Mesozoic Era  in the Standard Global Chronostratigraphic Scale.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012591, 1664);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013539, 'Mesozoic', 'MZ', 'The middle era of the Phanerozoic Eon of the Standard Global Chronostratigraphic Scale.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012591, 1663);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013540, 'Permian', 'P', 'The youngest period of the Paleozoic Era  in the Standard Global Chronostratigraphic Scale.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012591, 1662);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1679161121580275447, 'Working', 'Working', 'Pending Status for Geological Unit, Please read use case documents for business logic', NULL, '2006-12-04 00:00:00', NULL, 1679161121580275188, 1);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013541, 'Carboniferous', 'C', 'The second-youngest period of the Paleozoic Era  in the Standard Global Chronostratigraphic Scale.', NULL, '2007-10-27 00:00:00', NULL, 167916112856012591, 1661);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013542, 'Late Devonian', NULL, 'The youngest epoch of the Devonian Period in the Standard Global Chronostratigraphic Scale.', NULL, '2007-10-27 00:00:00', NULL, 167916112856012591, 1660);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013543, 'Middle Devonian', NULL, 'The middle epoch of the Devonian Period in the Standard Global Chronostratigraphic Scale.', NULL, '2007-10-27 00:00:00', NULL, 167916112856012591, 1659);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013544, 'Early Devonian', NULL, 'The oldest epoch of the Devonian Period in the Standard Global Chronostratigraphic Scale.', NULL, '2007-10-27 00:00:00', NULL, 167916112856012591, 1658);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013545, 'Devonian', 'D', 'The third-youngest period of the Paleozoic Era  in the Standard Global Chronostratigraphic Scale.', NULL, '2007-10-27 00:00:00', NULL, 167916112856012591, 1657);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013546, 'Pridoli', NULL, 'The youngest epoch of the Silurian Period in the Standard Global Chronostratigraphic Scale.', NULL, '2007-10-27 00:00:00', NULL, 167916112856012591, 1656);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013547, 'I-type', NULL, 'Igneous rock with characteristic mineralogy and chemistry, including alumina:alkalis*1.1, relatively low sodium and CIPW normative diopside or *1% CIPW normative corundum; implied to originate from igneous or infracrustal source rocks.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012572, 145);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013548, 'temperate', NULL, 'The climate of the middle latitudes, generally but not exclusively moderate or mild in temperature.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012525, 144);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013549, 'grassland', NULL, 'Climate where grasses grow.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012525, 143);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013550, 'desert', NULL, 'Mean annual precipitation of ten inches or less, and so devoid of vegetation as to be incapable of supporting any considerable population.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012525, 142);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013551, 'subtropical', NULL, 'The climate of the subtropics, which borders that of the tropics and is intermediate in character between tropical and temperate, though more like the former.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012525, 141);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013592, 'indurated', NULL, 'Requires blasting or heavy equipment to loosen; relative density 0.9-1.0; rings to blow of hammer.', 'lithified', '2007-10-28 00:00:00', NULL, 167916112856012586, 100);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013552, 'tropical', NULL, 'A climate characterised by high temperature and humidity and abundant rainfall; an area of tropical climate borders that of equatorial climate.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012525, 140);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971447769194, 'marcasite', 'Mcs', NULL, NULL, '2008-05-15 00:00:00', NULL, 1677736971447769085, 1290);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971447769306, 'NNW', NULL, 'NNW', NULL, '2008-02-24 00:00:00', NULL, 1677736971447769074, 1171);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (81, 'freshColour', NULL, NULL, NULL, '2007-10-26 00:00:00', NULL, 75, NULL);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013553, 'equatorial', NULL, 'A climate characterised by uniformly high temperature and humidity and heavy rainfall, and occurring in lowland areas within five to ten degrees of the equator.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012525, 139);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013554, 'Lithodemic', NULL, 'Geological unit type applicable to a defined body of rock distinguished and delimited on the basis of rock characteristics; generally does not conform to the Law of Superposition.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012596, 138);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013555, 'Lithostratigraphic', NULL, 'Geological unit type applicable to a defined body of strata which is distinguished and delimited on the basis of lithic characteristics and stratigraphic position; generally conforms to the Law of Superposition.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012596, 137);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013556, 'Member [metamorphic]', NULL, 'A named entity within a Formation that possesses lithologic characters distinguishing it from adjacent parts of the Formation.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012574, 136);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013557, 'Formation [metamorphic]', NULL, 'A body of metamorphic rock distinguishable by its lithology.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012574, 135);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013558, 'Complex [metamorphic]', NULL, 'A lithodemic unit composed predominantly of metamorphic rocks; usually with highly complicated structure, to the extent that the original sequence of component rocks may be obscured.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012574, 134);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013559, 'Phase', NULL, 'A named entity within an Intrusion that possesses lithologic characters distinguishing it from adjacent parts of the Intrusion.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012575, 133);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013560, 'Intrusion [rank]', NULL, 'A body of intrusive rock distinguishable by its lithology; primary formal unit of lithodemic classification; includes dyke swarms.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012575, 132);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013561, 'Suite', NULL, 'Two or more associated Intrusions with significant unifying lithologic features in common; the intrusive equivalent of a Group.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012575, 131);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013562, 'Supersuite', NULL, 'Two or more associated Suites with significant features in common; the intrusive equivalent of a Supergroup.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012575, 130);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013563, 'Complex [intrusive]', NULL, 'A lithodemic unit composed of igneous rocks, for example spatially and/or genetically related intrusive and extrusive rocks.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012575, 129);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013564, 'Batholith', NULL, 'A large area (*100square kilometres) of broadly contiguous Intrusions, Suites and/or Supersuites.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012520, 128);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013565, 'Bed [lithostratigraphic]', NULL, 'Unit layer in a stratified sequence of rocks which is lithologically distinguishable from other layers above and below.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012573, 127);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013566, 'Member [lithostratigraphic]', NULL, 'A named entity within a Formation that possesses lithologic characters distinguishing it from adjacent parts of the Formation.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012573, 126);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013567, 'Formation [lithostratigraphic]', NULL, 'A body of rock strata distinguishable by its lithology; primary formal unit of lithostratigraphic classification.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012573, 125);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013568, 'Subgroup [lithostratigraphic]', NULL, 'A Group may be divided into Subgroups; the term may be used in the same sense as Group.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012573, 124);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013569, 'Group [lithostratigraphic]', NULL, 'A sequence of two or more contiguous associated Formations with significant unifying lithologic features in common.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012573, 123);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013570, 'Supergroup [lithostratigraphic]', NULL, 'Several associated Groups, or associated Formations and Groups with significant features in common.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012573, 122);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013571, 'Complex [lithostratigraphic]', NULL, 'A lithostratigraphic unit composed of diverse types of any class or classes of rock; characterised by highly complicated structure to the extent that the original sequence of component rocks may be obscured.', NULL, '2007-11-01 00:00:00', NULL, 167916112856012573, 121);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013572, 'fresh rock', 'FR', 'Rock shows no sign of decomposition or staining.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012577, 120);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013573, 'slightly weathered rock', 'SW', 'Rock is slightly discoloured but shows little or no change of strength from fresh rock.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012577, 119);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013574, 'distinctly weathered rock', 'DW', 'Rock strength usually changed by weathering; the rock may be highly discoloured usually be iron staining; porosity may be increased by leaching or may be decreased due to deposition of weathering products in pores.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012577, 118);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013575, 'extremely weathered rock', 'XW', 'Rock is weathered to such an extent that it has *soil* properties i.e. it either disintegrates or can be remoulded in water.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012577, 117);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013576, 'residual soil', 'RS', 'Soil developed on extremely weathered rock; the mass structure and substance fabric are no longer evident; there is a large change in volume but the soil has not been significantly transported.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012577, 116);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013579, 'Bindian Orogeny', NULL, NULL, NULL, '2007-10-28 00:00:00', NULL, 167916112856012587, 113);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013580, 'Kanimblan Orogeny', NULL, NULL, NULL, '2007-10-28 00:00:00', NULL, 167916112856012587, 112);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013581, 'Tabberabberan Orogeny', NULL, NULL, NULL, '2007-10-28 00:00:00', NULL, 167916112856012587, 111);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013582, 'Benambran Orogeny', NULL, NULL, NULL, '2007-10-28 00:00:00', NULL, 167916112856012587, 110);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013583, 'recessive', NULL, 'Outcrops of geological unit are recessive relative to adjacent units.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012581, 109);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013584, 'slope-forming', NULL, 'Outcrops of geological unit form slopes.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012581, 108);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013585, 'ledge-forming', NULL, 'Outcrops of geological unit form ledges.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012581, 107);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013586, 'cliff-forming', NULL, 'Outcrops of geological unit form cliffs.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012581, 106);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013587, 'bouldery', NULL, 'Geological unit forms bouldery outcrops.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012581, 105);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013588, 'variable induration', NULL, 'Material is lithified, but induration varies at scale of description.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012586, 104);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013589, 'well indurated', NULL, 'Particles in the rock are strongly bound together such that rock surface can only be broken with great difficulty using standard rock hammer (* 1kg mass).', NULL, '2007-10-28 00:00:00', NULL, 167916112856012586, 103);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013590, 'moderately indurated', NULL, 'Multiple blows with standard rock hammer (* 1kg) are required to break rock.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012586, 102);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013593, 'well consolidated', NULL, 'Requires pick to loosen for shoveling; relative density 0.7-0.9.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012586, 99);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013594, 'moderately consolidated', NULL, 'Shoveled with difficulty.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012586, 98);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013595, 'residual rise', NULL, 'Isolated rise surrounded by other landforms; very low relief, very gentle to steep slopes.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 62);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013596, 'rises', NULL, 'Very low relief, very gentle to steep slopes; fixed erosional channels; dendritic to convergent, integrated or interrupted tributary pattern; eroded by continuously active to slightly active creep and sheet flow.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 61);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013597, 'etchplain', NULL, 'Level to undulating, extremely low relief; formed by deep weathering and erosion of the resulting weathered regolith; removal of  weathered material may be either partial or complete.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 60);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013598, 'peneplain', NULL, 'Level to gently undulating, extremely low relief; sparse slowly migrating channels; non-directional integrated tributary pattern; eroded by slightly active sheet flow, creep, and channelled and overbank stream flow.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 59);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013599, 'pediplain', NULL, 'Level to very gently inclined, extremely low relief; no stream channels; eroded by slightly active sheet flow and wind; largely relict after more effective erosion by stream flow in incipient channels, as on a pediment.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 58);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1679161121580275463, 'Geological Feature', 'GF', 'GeologicalFeature', NULL, '2006-12-18 00:00:00', NULL, 1679161121580275192, 1);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013600, 'pediment', NULL, 'Gently inclined to level, down-slope from adjacent hills; eroded and locally aggraded by frequently active channelled stream flow or sheet flow, subordinate wind erosion; underlain by bedrock.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 57);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013601, 'erosional plain', NULL, 'Level to undulating or, rarely, rolling landform pattern of extremely low relief; eroded by continuously active to slightly active or inactive geomorphic processes.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 56);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013602, 'erosional landforms', NULL, 'Very low to high relief landforms with very gentle to steep slopes; eroded by continuously active to slightly active or inactive geomorphic processes.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 55);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013603, 'sheet-flood fan', NULL, 'Level to very gently inclined, extremely low relief; numerous rapidly migrating, very shallow incipient channels; divergent to unidirectional, integrated or interrupted reticulated pattern; frequently active sheet flow and channelled stream flow.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 54);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013604, 'colluvial fan', NULL, 'Complex landform, very gently to moderately inclined, extremely low relief; generally fan-shaped plan form; divergent  channels are commonly present, but dominant process is colluvial deposition; usually steeper than an alluvial fan.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 53);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013605, 'colluvial landforms', NULL, 'Formed mainly under the influence of rainwash, sheetwash or creep; unconfined water flow.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 52);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013606, 'tidal flat [landform]', NULL, 'Level, extremely low relief; slowly migrating deep channels which form dendritic tributary patterns; aggraded by frequently active tides.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 51);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013607, 'marine plain', NULL, 'Eroded or aggraded by waves, tides, or submarine currents, aggraded by deposition from suspension and solution in sea water; elevated above sea level by earth movements or eustacy; little modified by subaerial agents.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 50);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013608, 'coral reef', NULL, 'Built up by corals and other organisms to present or former sea level; mainly level, steep slopes below sea level; channels generally absent, occasional fixed deep erosional tidal channels forming a disintegrated non-tributary pattern.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 49);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013609, 'beach ridge strandplain [landform]', NULL, 'Relict parallel linear ridges built up by waves and modified by wind; level to gently undulating, extremely low relief; channels are absent or very rare.', 'beach ridge plain', '2007-10-28 00:00:00', NULL, 167916112856012584, 48);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013610, 'chenier plain [landform]', NULL, 'Relict, parallel linear ridges built by waves, separated by and built over flats aggraded by tides or over bank stream flow; level to gently undulating, extremely low relief; stream channels are very rare.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 47);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013611, 'coastal plain [landform]', NULL, 'Level landform with extremely low relief either with or without stream channels; built up by coastal, usually tidal, processes.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 46);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013612, 'coastal landforms', NULL, 'Level to gently undulating landforms, extremely low relief; eroded or aggraded by waves, tides, overbank or channel flow, or wind; may be either active or relict.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 45);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013613, 'stream channel', NULL, 'Long narrow depression shaped by concentrated flow of a stream; covered continuously or periodically by water.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 44);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013614, 'alluvial fan [landform]', NULL, 'Complex, level to very gently inclined, extremely low relief landform with generally fan-shaped plan form; rapidly migrating   shallow to moderately deep channels; centrifugal to divergent, integrated, reticulated to distributary pattern.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 43);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013615, 'terraced land', NULL, 'One or more terraces and often a flood plain; low or very low relief (9 - 90m); terrace plains or terrace flats occur at stated heights above the top of the stream bank.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 42);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013616, 'terrace', NULL, 'Former flood plain on which erosion and aggradation by channelled and over-bank stream flow is slightly active or inactive because deepening or enlargement of the stream channel has lowered the level of flooding.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 41);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013617, 'stagnant alluvial plain', NULL, 'Erosion and aggradation by channelled and overbank stream flow is slightly active or inactive because of reduced water supply, without apparent incision or channel enlargement that would lower the level of stream action.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 40);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013618, 'floodout', NULL, 'Flat inclined radially away from a point on the margin or at the end of a stream channel; aggraded by overbank stream flow, or by channelled stream flow associated with channels developed within the overbank part.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 39);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013619, 'delta', NULL, 'Flood plain projecting into a sea or lake; slowly migrating deep channels, usually moderately spaced, typically forming a divergent distributary network; aggraded by frequently active over-bank and channelled stream flow; modified by tides.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 38);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013620, 'scroll plain', NULL, 'Large flat resulting from aggradation by channeled stream flow as a stream migrates from side to side; the dominant element of a meander plain; may include scroll, swale and ox-bow.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 37);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971447769337, 'cuprite', 'Cup', NULL, NULL, '2008-05-15 00:00:00', NULL, 1677736971447769088, 1306);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013621, 'meander plain', NULL, 'Meandering streams; widely spaced, rapidly migrating, moderately deep channels; unidirectional integrated non-tributary network; frequently active aggradation and erosion by channelled stream flow; less aggradation by over-bank stream flow.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 36);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013622, 'covered plain', NULL, 'Widely spaced channels (i.e., a little under a km), migrating more or less parallel;deep (i.e., width-depth ratio *20:1); aggradation by over-bank stream flow occurs at least once every 50 years, providing further alluvial cover.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 35);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013623, 'bar plain', NULL, 'Numerous sub-parallel channels both aggrade and erode to give a generally corrugated surface with numerous bars; rapidly migrating shallow channels; unidirectional integrated reticulated network; frequently active channelled stream flow.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 34);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013624, 'anastomotic plain', NULL, 'Channels join and divide like leaf veins; slowly migrating, deep alluvial channels, usually moderately spaced; divergent to unidirectional integrated reticulated network; frequently active aggradation by over bank and channelled stream flow.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 33);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013625, 'loosely consolidated', NULL, 'Easily shoveled, can be indented with fingers; relative density 0.2-0.4.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012586, 97);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013626, 'very loosely consolidated', NULL, 'Easily indented with fingers; relative density 0.0-0.2.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012586, 96);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013627, 'consolidated', NULL, 'Particulate constituents of a compound material adhere to each other strongly enough that the aggregate can be considered a solid material in its own right.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012586, 95);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013628, 'unconsolidated', NULL, 'Particulate constituents of a compound material do not adhere to each other strongly enough that the aggregate can be considered a solid in its own right.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012586, 94);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013629, 'ash plain', NULL, 'Level to undulating, very low relief; widely spaced fixed channels; non-directional integrated or interrupted tributary pattern; aggraded by ash fall, now relict; erosion by continuously active sheet flow, creep, and channelled stream flow.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 93);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013630, 'lava plateau', NULL, 'Plateau aggraded by volcanism (lava flow); generally relict, subject to erosion by continuously active sheet flow, creep, and channelled stream flow.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 92);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013631, 'lava flow [landform]', NULL, 'Individual lava flow, generally relict; subject to erosion by continuously active sheet flow, creep, and channelled stream flow.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 91);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013632, 'lava plain', NULL, 'Level to undulating, very low relief; widely spaced fixed channels; non-directional integrated or interrupted tributary pattern; aggraded by lava flows, now relict; erosion by continuously active sheet flow, creep, and channelled stream flow.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 90);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013633, 'volcanic plain [landform]', NULL, 'Level to undulating, very low relief; widely spaced fixed channels; non-directional integrated or interrupted tributary pattern; aggraded by volcanism, now relict; erosion by continuously active sheet flow, creep, and channelled stream flow.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 89);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013634, 'volcano', NULL, 'Very high, very steep landform pattern; no channels, or channels forming a centrifugal or radial tributary pattern; built up by volcanism, modified by erosional agents.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 88);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013635, 'volcanic cone [landform]', NULL, 'Low to high relief, very steep; no channels, or erosional rills forming a radial tributary pattern; built up by volcanism and slightly modified by erosional agents; the crest may form a ring around a crater.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 87);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013636, 'shield volcano [landform]', NULL, 'Symmetrical, circular to elliptical volcanoes; diameter from a few km to over 100km; gentle slopes (*10 degrees); built up by frequent eruptions of fluid basaltic lava.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 86);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013637, 'lava dome [landform]', NULL, 'Dome-shaped mountain of solidified lava; form is that of many individual flows.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 85);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013638, 'caldera', NULL, 'Very high relief, steep to precipitous slopes; no channels or fixed channels; centripetal integrated tributary pattern; has subsided or was excavated as a result of volcanism.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 84);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013639, 'eruption centre [landform]', NULL, 'Locus of ejection of volcanic materials onto the Earth*s surface; may be a central vent, a fissure or a group of fissures.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 83);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013640, 'volcanic landforms', NULL, 'Landforms that are the direct result of volcanic activity.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 82);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013641, 'meteor crater', NULL, 'Circular closed depression with a raised margin, typically low to high relief; large range of slope values; no channels, or a peripheral integrated pattern of centrifugal tributary streams; excavated, heaved up and built up by a meteor impact.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 81);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013642, 'made land', NULL, 'Typically very low or extremely low relief, slopes level and very steep; sparse, fixed deep artificial channels, non-directional interrupted tributary pattern; eroded and aggraded, built up or excavated, by rarely active human agency.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 80);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013643, 'made landforms', NULL, 'Constructed landforms, artificially filled or excavated.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 79);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013644, 'playa plain', NULL, 'Level, extremely low relief; typically without stream channels; aggraded by rarely active sheet flow and modified by wind, waves, and soil phenomena; sediment sinks occupying the lowest parts of the landscape.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 78);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013645, 'lacustrine plain', NULL, 'Level, extremely low relief; occupied by a lake but now partly or completely dry; relict after aggradation by waves and by deposition of material from suspension and solution in standing water.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 77);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013646, 'lacustrine landforms', NULL, 'Landforms produced by or formed in a lake or lakes.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 76);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013647, 'erosional glacial landforms', NULL, 'Includes cirques and U-shaped valleys.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 75);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013648, 'depositional glacial landforms', NULL, 'Includes moraines of various kinds and irregular landforms made up of glacial deposits.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 74);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013649, 'glacial landforms', NULL, 'Landforms produced by glacial processes; most landforms of this type in Australia are relict (except Heard Island).', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 73);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013650, 'plateau surface', NULL, 'The low relief surface of a plateau.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 72);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013651, 'plateau edge', NULL, 'Cliff, scarp or escarpment that extends around a large part of the perimeter of a plateau.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 71);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971447769338, 'cassiterite', 'Cst', NULL, NULL, '2008-05-15 00:00:00', NULL, 1677736971447769088, 1304);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013652, 'plateau', NULL, 'Level to rolling plains, rises or low hills standing above a cliff, scarp or escarpment that extends around a large part of its perimeter; bounding scarp or cliff may be included or excluded but a bounding escarpment is an adjacent landform.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 70);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013653, 'karst', NULL, 'Unspecified relief and slope (use e.g. karst rises); fixed deep channels; non-directional disintegrated tributary pattern, many closed depressions without channels; eroded by continuously active solution and rarely active collapse.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 69);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013654, 'badlands', NULL, 'Low to extremely low relief, steep to precipitous slopes; numerous fixed channels; dendritic to parallel integrated tributary network; continuously active erosion by collapse, landslide, sheetflow, creep and channelled stream flow.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 68);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013655, 'escarpment', NULL, 'Steep to precipitous, linearly extensive, straight or sinuous inclined surface; separates terrains at different altitudes; relief may be high (hilly) or low (planar); a cliff or scarp often marks the upper margin; upper terrain often a plateau.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 67);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013656, 'mountains', NULL, 'Very high relief, moderate to precipitous slopes; fixed channels, closely to very widely spaced; dendritic or diverging integrated tributary network; continuously active erosion by collapse, landslide, sheet flow, creep, channelled stream flow.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 66);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013657, 'hills', NULL, 'High relief, gentle to precipitous slopes; fixed, shallow channels, closely to very widely spaced; dendritic or convergent integrated tributary network; continuously active erosion by wash and creep; rarely active erosion by landslides.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 65);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013658, 'residual low hill', NULL, 'Isolated low hill surrounded by other landforms; low relief, gentle to very steep slopes.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 64);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013659, 'low hills', NULL, 'Low relief, gentle to very steep slopes; fixed erosional channels, closely to very widely spaced; dendritic or convergent integrated tributary pattern; continuously active sheet flow, creep, and channelled stream flow.', NULL, '2007-10-28 00:00:00', NULL, 167916112856012584, 63);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013660, 'Ludlow', NULL, 'The second-youngest epoch of the Silurian Period in the Standard Global Chronostratigraphic Scale.', NULL, '2007-10-27 00:00:00', NULL, 167916112856012591, 1655);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013661, 'Wenlock', NULL, 'The second-oldest epoch of the Silurian Period in the Standard Global Chronostratigraphic Scale.', NULL, '2007-10-27 00:00:00', NULL, 167916112856012591, 1654);
