INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971447769310, 'andesitic rock', NULL, 'Preliminary classification for a volcanic rock tentatively identified as andesite.', NULL, '2008-04-25 00:00:00', NULL, 1677736971447769071, 1172);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013706, 'Precambrian', 'pE', 'Describes all rocks older than the Cambrian Period of the Standard Global Chronostratigraphic Scale.  It includes the Archean and Proterozoic eons and represents 90 percent of geological time.', 'Archeozoic', '2007-10-27 00:00:00', NULL, 167916112856012591, 1617);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013707, 'archived', NULL, 'Data has been through peer review and deemed suitable for public release, but has been superseded; may not validate against current business rules.', NULL, '2007-10-27 00:00:00', NULL, 167916112856012598, 4);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013708, 'accepted', NULL, 'Data has been through peer review and deemed suitable for public release; continually subject to business rules.', NULL, '2007-10-27 00:00:00', NULL, 167916112856012598, 3);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013709, 'working', NULL, 'Under construction; data is not subject to business rules.', NULL, '2007-10-27 00:00:00', NULL, 167916112856012598, 2);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013710, 'reference', NULL, 'A published or unpublished article that is retrievable either in hardcopy or digital copy.', NULL, '2007-10-27 00:00:00', NULL, 167916112856012599, 1);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013711, 'party', NULL, 'A person or an organisation.', NULL, '2007-10-27 00:00:00', NULL, 167916112856012599, 0);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193452, 'earth flow', NULL, 'Material deposited by a landslide within well-defined lateral boundaries; low fluidity.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193635, 1572);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193453, 'mudflow [material]', NULL, 'Mostly fine-grained mass movement deposit, with less than 50% sand-sized material; may have up to 60% water content during deposition.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193635, 1573);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193454, 'lahar', NULL, 'Mudflow composed chiefly of volcaniclastic material on the flank of a volcano.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193635, 1574);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193455, 'debris flow', NULL, 'Mass wasting deposit of rock fragments, soil and mud where more than half the particles are greater than sand size.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193635, 1575);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193456, 'duricrust', NULL, 'Hard crust or layer at or near the Earth*s surface.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193634, 1576);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193457, 'colluvium', NULL, 'Material deposited by unconfined surface runoff, sheet wash, or slow continuous downslope creep.', 'colluvial deposit', '2008-05-30 00:00:00', NULL, 1677736971154193633, 1568);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193458, 'tillite', NULL, 'Consolidated, dominantly heterogeneous, unsorted and unstratified drift, deposited directly by and underneath a glacier without subsequent reworking by meltwater.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193632, 1570);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193459, 'till', NULL, 'Unconsolidated, dominantly heterogeneous, unsorted and unstratified drift, deposited directly by and underneath a glacier without subsequent reworking by meltwater.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193632, 1569);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193460, 'varves', NULL, 'Thin pairs of graded beds or laminae in lakes or other still water bodies in front of a glacier; formed by seasonal deposition, usually a coarse summer layer grading into a finer winter deposit.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193632, 1571);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193461, 'mottles', NULL, 'Segregations of subdominant colour different from the surrounding region*s colour; may have sharp, distinct or diffuse boundaries.  Typically range in size from 10-100 mm, but may be up to several metres across.', NULL, '2008-05-30 00:00:00', NULL, 167916112856012576, 1562);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193462, 'varnish', NULL, 'Surfaces of clasts are covered by dark brown to black, generally shiny varnish.', NULL, '2008-05-30 00:00:00', NULL, 167916112856012576, 1563);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193463, 'fill', NULL, 'Deposits of natural earth materials and waste materials deposited by human activity and used to fill an enclosed space (eg. a stope) or to raise the surface of the land (eg. an embankment).', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193630, 1564);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193465, 'mullock', NULL, 'Waste rock in mining that has been removed or set aside to gain access to and excavate ore.', 'waste rock', '2008-05-30 00:00:00', NULL, 1677736971154193630, 1566);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193466, 'tailings', NULL, 'That portion of washed or milled ore that is regarded as too poor to be treated further.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193630, 1565);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193467, 'liesegang bands', NULL, 'Nested rings or bands of yellow, brown or red colour in weathered rocks, generally caused by precipitation of iron oxides from solution.', 'liesegang rings', '2008-05-30 00:00:00', NULL, 167916112856012576, 1561);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1021, 'CODE12', 'CODE12 ABBREVATION', 'CODE DESCRIPTION12', 'CODE12GUSSYNONYM', '2006-12-12 00:00:00', NULL, 1001, 1);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193468, 'gossan', NULL, 'Weathered expression of rocks that contained substantial sulphide mineralisation; commonly have boxwork fabric.', NULL, '2008-05-30 00:00:00', NULL, 167916112856012576, 1560);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193469, 'gilgai', NULL, 'Surface micro-relief (up to a few metres) consisting of mounds and depressions of varying sizes and spatial distribution, some separated by a planar or slightly undulating surface; associated with soils containing shrink-swell clays.', NULL, '2008-05-30 00:00:00', NULL, 167916112856012576, 1559);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193470, 'calcrete', NULL, 'Calcareous duricrust; surficial or near-surface sand and gravel cemented into a hard mass by calcium carbonate.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193634, 1577);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193471, 'ferricrete', NULL, 'Ferruginous duricrust; surficial or near-surface sand and gravel cemented into a hard mass by iron oxide.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193634, 1579);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193472, 'caliche', NULL, 'Near-surface layer more or less cemented by soluble minerals (calcite, dolomite, nitre, halite, etc.); may occur as a soft thin soil horizon, as a hard thick bed just beneath the solum, or as a surface layer exposed by erosion.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193634, 1578);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971447769361, 'crystal', NULL, NULL, NULL, '2008-02-21 00:00:00', NULL, 1677736971447769084, 997);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193473, 'gypcrete', NULL, 'Gypsiferous duricrust; surficial or near-surface sand and gravel cemented into a hard mass by gypsum.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193634, 1580);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193474, 'silcrete', NULL, 'Siliceous duricrust; surficial or near-surface sand and gravel cemented into a hard mass by silica.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193634, 1581);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193475, 'soil', NULL, 'Unconsolidated mineral or organic material at the earth*s surface formed by soil-forming processes (climate, biota, relief, parent material, time).', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193634, 1582);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193476, 'lag', NULL, 'Residual accumulation of coarse, usually hard rock fragments on a surface after the finer material has been blown away by wind.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193633, 1583);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193477, 'calcareous sinter', NULL, 'Finely crystalline massive or concretionary limestone formed by rapid chemical precipitation from solution in surface and ground waters; forms at spring mouths, in caves, soil crusts, as vein filling and along faults.', 'travertine', '2008-05-30 00:00:00', NULL, 1677736971154193633, 1584);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193478, 'siliceous sinter', NULL, 'Nonclastic siliceous sedimentary rock of 50-90% porosity composed predominantly of lightweight, white opaline silica; deposited by precipitation from the waters of geysers and hot springs.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193633, 1585);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193479, 'intrusive rock', NULL, 'Igneous rock formed by crystallisation of magma in pre-existing rock.', NULL, '2008-06-01 00:00:00', NULL, 1677736971154193631, 1609);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193480, 'chilled contact', NULL, 'Border or outer zone of an igneous intrusion that is finer grained than the interior; due to more rapid cooling.', NULL, '2008-06-01 00:00:00', NULL, 1677736971154193631, 1610);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193482, 'exhalite', NULL, 'Chemical sediment formed by the issuance of volcanically-derived fluids onto the sea floor or into the sea, such as black smoker chimney deposits.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193631, 1608);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193483, 'scoria', NULL, 'Highly vesiculated lava or tephra; usually of mafic composition.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193631, 1606);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193484, 'impactite', NULL, 'Shock-metamorphosed rock, including breccias and melt rocks.', NULL, '2008-06-01 00:00:00', NULL, 1677736971154193631, 1614);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193485, 'regional aureole intrusion', NULL, 'Intrusion that has cooled in a regional metamorphic environment at high T*P; minerals such as quartz and K-feldspar tend to recrystallise on cooling and uplift, giving the appearance of a metamorphic rock, for example triple junctions.', NULL, '2008-06-01 00:00:00', NULL, 1677736971154193631, 1613);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193486, 'sub-volcanic intrusion', NULL, 'Intrusion that has crystallised at shallow depth; irregular distribution of porphyritic texture, graphic mineral intergrowths and miarolitic cavities are all characteristic if present.', NULL, '2008-06-01 00:00:00', NULL, 1677736971154193631, 1612);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193487, 'cumulate', NULL, 'Igneous rock formed by the accumulation of crystals settling out from a magma under gravity.', NULL, '2008-06-01 00:00:00', NULL, 1677736971154193631, 1611);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193488, 'ejecta', NULL, 'Solid, liquid or vaporised rock ejected ballistically from an explosion or impact crater during formaiton; may be distributed around crater in distinctive patterns, forming ejecta rays or loops, as well as partially building the rim.', NULL, '2008-06-01 00:00:00', NULL, 1677736971154193631, 1615);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856013471, 'spelean', NULL, 'Formed in caves.', 'caves;cavern;cave', '2007-11-02 00:00:00', NULL, 167916112856012566, 285);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193489, 'enclave', NULL, 'Fragment of older material within an igneous rock to which it may or may not be genetically related.', NULL, '2008-06-01 00:00:00', NULL, 1677736971447769084, 1616);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193490, 'thick-bedded sandstone or sand-dominant facies (2)', NULL, 'Thick sandstone turbidites and minor intercalated mudstone; sand:shale range 3.5:1 to 6.0:1; Bouma Ta or Ta(c)e divisions dominant, up to several metres thick; facies intervals up to several tens of metres thick.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193631, 1589);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193491, 'massive sandstone-granulestone facies (3)', NULL, 'Well-sorted massive sandstone to granulestone; beds up to several metres thick, packages tens of metres thick; scoured bases, strong thickness variation; some laminar and/or tabular cross lamination; most commonly associated with facies 1 and 2.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193631, 1590);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193492, 'turbidite', NULL, 'Material deposited from a turbidity current; characterised by graded bedding, moderate sorting and well-developed primary structures in the sequence noted in the Bouma cycle.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193631, 1587);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193493, 'amalgamated sandstone facies (1)', NULL, 'Amalgamated sandstone beds, generally massive; all or most are Bouma Ta; sand:shale ratio more than 6.0:1; individual beds up to several m thick, facies intervals from several m to tens of metres; scouring and channelling, mudstone clasts relatively common.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193631, 1588);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193494, 'pseudobreccia', NULL, 'Limestone characterised by a mottled appearance, mimicking a breccia; or a weathered surface that appears deceptively fragmental.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193631, 1586);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193495, 'hyaloclastite', NULL, 'Rock formed by intrusion of lava or magma into water, ice or water-saturated sedimen, such that the lava shatters into small angular fragments; includes vitric tuff from shallow-water explosive volcanism or explosive interaction of magma and ground water.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193631, 1595);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193496, 'guano', NULL, 'Phosphate-rich sedimentary rock formed from the excrement of birds or bats.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193631, 1594);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193497, 'bioclastic', NULL, 'Sedimentary rock composed of fragments that have been broken from pre-existing rocks, or pulverised or arranged, by the action of living organisms;  the rock need not consist of biogenic material.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193631, 1593);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193498, 'mudstone (or mudstone-dominant) facies (5)', NULL, 'Sand:shale ratio less than 0.5:1; mudstone up to tens of metres thick; massive to laminated, thinly bedded intercalations of siltstone or fine sandstone; ripple-drift lamination or starved ripples common; Tc(d)e units common in siltstone and sandstone interbeds.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193631, 1592);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193499, 'mixed sandstone-mudstone facies (4)', NULL, 'Regularly interbedded thin sandstone and mudstone; sand:shale ratio 0.5:1 to 3.5:1; beds are tens of centimetres to centimetres thick, facies intervals up to tens of metres thick; Bouma Ta prominent but Tb, Tc, and T(d)e are common; units of Tcde common.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193631, 1591);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193500, 'agglutinate', NULL, 'Welded pyroclastic rock bound by vitric material; formed by spatter, commonly bombs, fused while hot and viscous.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193631, 1598);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193501, 'autobreccia', NULL, 'Fragmentary texture formed by incorporating the first solidified lava crust into a still-fluid lava flow.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193631, 1599);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193502, 'fragmental deposit', NULL, 'Rock texture of explosive origin; formed by volcanic explosion or aerial expulsion from a vent.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193631, 1600);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193503, 'peperite', NULL, 'Rock formed as a result of lava mixing with marine sediment, for example lava flowing onto the sea bed, or as shallow intrusion of magma into wet sediment.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193631, 1596);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193504, 'extrusive rock', NULL, 'Igneous rock erupted onto the surface of the Earth, including under the sea.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193631, 1597);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193505, 'pahoehoe', NULL, 'Basaltic lava flow with a smooth, billowy or ropy surface.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193631, 1605);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1679161121580275635, 'Definition', 'Definition', 'Definition', 'definingNorm', '2006-12-18 00:00:00', NULL, 1679161121580275193, 1);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193506, 'aa', NULL, 'Lava flow with rough, jagged, spinose, clinkery surface; Hawaiian expletive of pain uttered when walking barefoot on such lava.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193631, 1604);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193507, 'ignimbrite', NULL, 'Pyroclastic rock formed by the widespread deposition and consolidation of ash flows; welding may be present but is not characteristic.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193631, 1601);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193508, 'lava flow [rock type]', NULL, 'Rock formed by a lateral, surficial outpouring of molten lava from a vent or fissure.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193631, 1603);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971154193509, 'accretionary lapilli', NULL, 'Lapilli forming spheroidal pellets, usually 1-10 mm across, of consolidated or cemented ash; formed by accretion of ash particles around a wet nucleus.', NULL, '2008-05-30 00:00:00', NULL, 1677736971154193631, 1602);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971447769195, 'layer', NULL, 'Constituent forms a layer within the GeologicUnit.', NULL, '2008-02-21 00:00:00', NULL, 1677736971447769076, 1015);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971447769197, 'layers', NULL, 'Constituent forms layers within the GeologicUnit.', 'layered constituent', '2008-02-21 00:00:00', NULL, 1677736971447769076, 1016);
