INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299090, 'charnockite', NULL, 'Granite that contains orthopyroxene.', NULL, '2008-05-21 00:00:00', NULL, 1677736971447769071, 1442);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299091, 'alaskite', NULL, 'Light coloured alkali feldspar granite with M less than 10 percent; consists almost entirely of quartz and alkali feldspar.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1440);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299092, 'granite', NULL, 'QAPF Field 3; plutonic rock consisting essentially of quartz, alkali feldspar and sodic plagioclase in varying amounts usually with biotite and/or hornblende.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1441);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299093, 'trondhjemite', NULL, 'Leucocratic variety of tonalite consisting essentially of sodic plagioclase and quartz with minor biotite.', NULL, '2208-05-21 00:00:00', NULL, 1677736971447769071, 1445);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299094, 'tonalite', NULL, 'QAPF Field 5; plutonic rock consisting essentially of quartz and intermediate plagioclase, usually with biotite and amphibole.', NULL, '2008-05-21 00:00:00', NULL, 1677736971447769071, 1444);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299095, 'granodiorite', NULL, 'QAPF Field 4; plutonic rock consisting essentially of quartz, sodic plagioclase and lesser amounts of alkali feldspar with minor hornblende and biotite.', NULL, '2008-05-21 00:00:00', NULL, 1677736971447769071, 1443);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299096, 'smithsonite', 'Smn', NULL, NULL, '2008-05-17 00:00:00', NULL, 1677736972070299357, 1338);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299097, 'anglesite', 'Ang', NULL, NULL, '2008-05-17 00:00:00', NULL, 1677736972070299359, 1339);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299099, 'rhodochrosite', 'Rds', NULL, NULL, '2008-05-17 00:00:00', NULL, 1677736972070299357, 1336);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299100, 'quartz alkali feldspar syenite', NULL, 'QAPF Field 6*; an alkali feldspar syenite with 5-20 percent quartz.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1447);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299101, 'alkali feldspar syenite', NULL, 'QAPF Field 6; a syenite with plagioclase less than 10 percent of the total feldspar.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1446);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299102, 'coarse lithic tuff', NULL, 'Coarse (ash) tuff that consists predominantly of rock fragments.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1428);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299103, 'fault or shear zone rock', NULL, 'Rock physically associated with fault surfaces or zones of partitioned shear strain and genetically related to fault movement or shearing.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1524);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299104, 'fault breccia', NULL, 'Incohesive, random fabric rock material in which visible fragments are more than 30 percent of rock mass; matrix is fine clay-like material formed by crushing of rock in a fault.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1525);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299180, 'potassic trachybasalt', NULL, 'Potassic variety of trachybasalt.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1499);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299105, 'fault gouge', NULL, 'Incohesive, random fabric rock material in which visible fragments are less than 30 percent of rock mass; fine clay-like material formed by crushing of rock in a fault.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1526);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299106, 'pseudotachylite', NULL, 'Dark grey or black rock breccia with a glassy matrix that typically occurs in branching veins; formed by compression and shear associated with intense fault movement involving extreme cataclasis and partial melting.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1527);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299107, 'fine vitric tuff', NULL, 'Fine (ash) tuff that consists predominantly of glass.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1431);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299108, 'tuffite', NULL, 'Mixed pyroclastic-epiclastic rock, with pyroclastic fragments 75-25 percent.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1432);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299109, 'fine (ash) tuff', NULL, 'Pyroclastic rock in which the proportion of ash is greater than 75 percent and the ash grains are moslty less than 0.032 mm maximum diameter.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1429);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299110, 'tectonic melange', NULL, 'Mappable body of rock lacking internal continuity of contacts or strata and including fragments and blocks of all sizes, both exotic and native, embedded in a fragmental matrix of finer-grained material; formed by tectonic processes.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1523);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299112, 'vitric tuff', NULL, 'Tuff that consists predominantly of pumice and glass.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1423);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299113, 'slate', NULL, 'Ultrafine or very fine grained metamorphic rock with a slaty cleavage.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1520);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299114, 'serpentinite', NULL, 'Metamorphic rock consisting almost wholly of serpentine-group minerals, eg. antigorite, chrysotile or lizardite; accessory chlorite, talc and magnetite may be present; derived from hydration of ferromagnesian silicate minerals such as olivine and pyroxene.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1519);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299115, 'fold breccia', NULL, 'Local tectonic breccia resulting from the sharp folding of thin-bedded, brittle rock layers between which are incompetent ductile beds.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1522);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299116, 'tectonic breccia', NULL, 'Breccia formed as a result of crustal movements; usually developed in brittle rocks.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1521);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299117, 'coarse vitric tuff', NULL, 'Coarse (ash) tuff that consists predominantly of pumice and glass.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1427);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299118, 'coarse crystal tuff', NULL, 'Coarse (ash) tuff that consists predominantly of crystals and fragments of crystals.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1426);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299119, 'coarse (ash) tuff', NULL, 'Pyroclastic rock in which the proportion of ash is greater than 75 percent and the ash grains are moslty 0.032-2 mm maximum diameter.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1425);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299120, 'quartzite', NULL, 'Granoblastic metamorphic rock consisting mainly of quartz; formed by recrystallisation of sandstone or chert.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1518);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299121, 'lithic tuff', NULL, 'Tuff that consists predominantly of rock fragments.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1424);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299122, 'phyllonite', NULL, 'Mylonite or ultramylonite composed largely of fine-grained mica that imparts a sheen to foliation surfaces.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1537);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299123, 'crystal tuff', NULL, 'Tuff that consists predominantly of crystals and fragments of crystals.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1422);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299124, 'mylonite', NULL, 'Strongly foliated fine-grained rock with 50-90 percent matrix; typically has anastomosing foliation, S-C fabrics, ribbons, rounded porphyroclasts or stretching lineation;  formed by ductile shearing; matrix is caused by tectonic grainsize reduction.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1535);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299125, 'ultramylonite', NULL, 'Very fine-grained mylonitic rock with more than 90 percent matrix and very few porphyroclasts; matrix is fine-grained material caused by tectonic grainsize reduction.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1536);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299126, 'ultracataclasite', NULL, 'Cohesive, random fabric fault rock with matrix comprising more than 90 percent of rock mass; matrix is fine-grained material caused by tectonic grainsize reduction.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1533);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299127, 'pyroclastic breccia', NULL, 'Pyroclastic rock in which the proportion of blocks is greater than 75 percent.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1418);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299128, 'protomylonite', NULL, 'Mylonitic rock with 10-50 percent fine-grained matrix, and therefore with much of the original rock texture and mineralogy intact; matrix is fine-grained material caused by tectonic grainsize reduction.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1534);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1679161121580275464, 'Description', 'Description', 'Description', 'typicalNorm', '2006-12-18 00:00:00', NULL, 1679161121580275193, 2);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299129, 'tuff breccia', NULL, 'Pyroclastic rock in which bombs and/or blocks range in proportion from 25-75 percent.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1419);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299130, 'lapilli tuff', NULL, 'Pyroclastic rock in which bombs or blocks comprise less than 25% of the rock, and both lapilli and ash are less than 75 percent.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1420);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299131, 'lapillistone', NULL, 'Pyroclastic rock in which the proportion of lapilli is greater than 75 percent.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1421);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299132, 'agglomerate', NULL, 'Pyroclastic rock in which the proportion of bombs is greater than 75 percent.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1417);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299133, 'cataclasite', NULL, 'Cohesive, random fabric fault rock with matrix comprising 50-90 percent of rock mass; matrix is fine-grained material caused by tectonic grainsize reduction.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1532);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299134, 'protocataclasite', NULL, 'Cohesive, random fabric fault rock with matrix comprising 10-50 percent of rock mass; matrix is fine-grained material caused by tectonic grainsize reduction.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1531);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299135, 'crush microbreccia', NULL, 'Cohesive, random fabric fault rock with matrix comprising less than 10 percent of rock mass, and fragments less than 0.1 cm size; matrix is fine-grained material caused by tectonic grainsize reduction.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1530);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299137, 'fine crush breccia', NULL, 'Cohesive, random fabric fault rock with matrix comprising less than 10 percent of rock mass, and fragments 0.1-0.5 cm size; matrix is fine-grained material caused by tectonic grainsize reduction.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1529);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299139, 'crush breccia', NULL, 'Cohesive, random fabric fault rock with matrix comprising less than 10 percent of rock mass, and fragments more than 0.5 cm maximum diameter; matrix is fine-grained material caused by tectonic grainsize reduction.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1528);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299140, 'agate', NULL, 'Translucent, cryptocrystalline quartz; variegated chalcedony, commonly mixed or alternating with opal and characterised by banded colours.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1416);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299141, 'flint', NULL, 'Nodular grey or black chert.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1415);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299142, 'opaline porcellanite', NULL, 'Porcellanite whose silica includes amorphous silica (opal-A), opal CT, low-cristobalite and tridymite.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1409);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299143, 'quartzose porcellanite', NULL, 'Porcellanite whose silica consists predominantly of quartz.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1410);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299144, 'porcellanite', NULL, 'Siliceous sedimentary rock of 15-30 percent porosity, with the texture, lustre and conchoidal fracture of porcelain.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1408);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299145, 'chert', NULL, 'Siliceous sedimentary rock that is dense, very hard and has a vitreous lustre.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1411);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299146, 'opaline chert', NULL, 'Chert whose silica includes amorphous silica (opal-A), opal CT, low-cristobalite and tridymite.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1412);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299147, 'radiolarite', NULL, 'Siliceous sedimentary rock of 50-90 percent porosity composed predominantly of radiolaria.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1405);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299148, 'diatomite', NULL, 'Siliceous sedimentary rock of 50-90 percent porosity composed predominantly of diatoms.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1404);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299149, 'phosphorite', NULL, 'Sedimentary rock with more than 50 percent phosphate minerals.', 'phosphatic rock', '2008-05-18 00:00:00', NULL, 1677736971447769071, 1403);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299150, 'siliceous sinter', NULL, 'Siliceous sedimentary rock of 50-90 percent porosity composed predominantly of lightweight, white opaline silica.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1407);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299151, 'spiculite', NULL, 'Siliceous sedimentary rock of 50-90 percent porosity composed predominantly of sponge spicules.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1406);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299152, 'humic coal series', NULL, 'Coal developed from peat; visibly stratified; layers or bands of organic matter with individual layers no more than a few cm thick.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1398);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299153, 'lignite', NULL, 'Consolidated, dull, soft brown to black coal with many readily discernible plant fragments in a finer grained organic matrix.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1399);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299155, 'anthracite', NULL, 'Hard black coal with a semi-metallic lustre and semiconchoidal fracture.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1401);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299156, 'sapropelic coal series', NULL, 'Coal developed from sapropel; homogeneous texture, characteristically massive, common conchoidal fracture and generally well preserved algal, miospore and fine plant remains.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1402);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299157, 'dolomite-boundstone', NULL, 'Carbonate rock in which the original components were bound and encrusted together by the action of plants and animals in the position of growth; main carbonate mineral is dolomite.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1394);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299158, 'lime-boundstone', NULL, 'Carbonate rock in which the original components were bound and encrusted together by the action of plants and animals in the position of growth; main carbonate mineral is calcite.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1393);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299159, 'lime-framestone', NULL, 'Carbonate reef rock consisting of a rigid framework of colonies, shells or skeletons, with internal cavities filled with fine sediment; main carbonate mineral is calcite.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1396);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299160, 'framestone', NULL, 'Carbonate reef rock consisting of a rigid framework of colonies, shells or skeletons, with internal cavities filled with fine sediment.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1395);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299161, 'dolomite-framestone', NULL, 'Carbonate reef rock consisting of a rigid framework of colonies, shells or skeletons, with internal cavities filled with fine sediment; main carbonate mineral is dolomite.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1397);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299162, 'boundstone', NULL, 'Carbonate rock in which the original components were bound and encrusted together by the action of plants and animals in the position of growth, as in reef limestones.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1392);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299163, 'dolomite-grainstone', NULL, 'Grain-supported carbonate rock with little matrix; main mineral is dolomite.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1391);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299164, 'lime-grainstone', NULL, 'Grain-supported carbonate rock with little matrix; main mineral is calcite.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1390);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971447769362, 'concretion', NULL, NULL, NULL, '2008-02-21 00:00:00', NULL, 1677736971447769084, 996);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299165, 'grainstone', NULL, 'Grain-supported carbonate rock with little matrix.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1389);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299166, 'dolomite-packstone', NULL, 'Grain-supported carbonate rock with intergranular spaces filled by matrix; main carbonate mineral is dolomite.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1388);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299167, 'tholeiitic basalt', NULL, 'Basalt composed of labradorite, augite, hypersthene (=enstatite) or pigeonite, with olivine (often showing a reaction relationship) or quartz, and often with interstitial glass.', 'tholeiite', '2008-05-22 00:00:00', NULL, 1677736971447769071, 1488);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299169, 'subalkali basalt', NULL, 'Basalt without CIPW normative nepheline.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1490);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299170, 'phonolite', NULL, 'QAPF Field 11 or TAS Field Ph; volcanic rock consisting of alkali feldspar and any feldspathoids; if nepheline is not the only feldspathoid present, use the name of the most abundant feldspathoid as a qualifier, eg. leucite phonolite.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1491);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299171, 'peralkaline phonolite', NULL, 'Phonolite containing sodic pyroxene and/or sodic amphibole.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1492);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299172, 'phonolitic basanite', NULL, 'QAPF Field 13; alkaline basaltic rock consisting of plagioclase, feldspathoid,  greater than 10 percent olivine, augite and often minor sanidine; volcanic equivalent of foid monzodiorite or foid monzogabbro.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1494);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299173, 'tephritic phonolite', NULL, 'QAPF Field 12; alkaline volcanic rock consisting of alkali feldspar, sodic plagioclase, feldspathoid and various mafic minerals.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1493);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299174, 'basanite', NULL, 'QAPF Field 14 or TAS Field U1 with CIPW normative olivine greater than 10 percent; volcanic rock composed of clinopyroxene, plagioclase, essential foids and olivine.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1496);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299175, 'phonolitic tephrite', NULL, 'QAPF Field 13; alkaline volcanic rock consisting of plagioclase, feldspathoid, augite and often minor olivine (less than 10 percent) and sanidine.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1495);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299176, 'tephrite', NULL, 'QAPF Field 14 or TAS Field U1 with CIPW normative olivine less than 10 percent; alkaline volcanic rock composed of calcic plagioclase, clinopyroxene and feldspathoid.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1497);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299177, 'dolomite-wackestone', NULL, 'Matrix-supported carbonate rock composed of less than 75 percent mud-sized grains; main carbonate mineral is dolomite.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1385);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299178, 'packstone', NULL, 'Grain-supported carbonate rock with intergranular spaces filled by matrix.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1386);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299179, 'lime-packstone', NULL, NULL, NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1387);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299181, 'mugearite', NULL, 'Sodic variety of basaltic trachyandesite; volcanic rock, often with flow texture, containing small phenocrysts of olivine, augite and magnetite in a matrix of oligoclase, augite and magnetite with interstitial alkali feldspar.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1500);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299182, 'hawaiite', NULL, 'Sodic variety of trachybasalt.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1498);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299183, 'shoshonite', NULL, 'Potassic variety of basaltic trachyandesite.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1501);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299184, 'camptonite', NULL, 'Lamprophyre with more plagioclase than orthoclase, more feldspar than feldspathoid, brown amphibole, Ti-augite, olivine and biotite.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1502);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299185, 'carbonate wackestone', NULL, 'Matrix-supported carbonate rock composed of less than 75 percent mud-sized grains.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1383);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299186, 'lime-wackestone', NULL, 'Matrix-supported carbonate rock composed of less than 75 percent mud-sized grains; main carbonate mineral is calcite.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1384);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299187, 'monchiquite', NULL, 'Lamprophyre with glass or feldspathoid, brown amphibole, Ti-augite, olivine and biotite.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1505);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299188, 'minette', NULL, 'Lamprophyre with more orthoclase than plagioclase and more biotite than hornblende; may contain diopside, augite, or olivine.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1504);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299189, 'kersantite', NULL, 'Lamprophyre with more plagioclase than orthoclase and more biotite than hornblende; may contain diopside, augite, or olivine.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1503);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299190, 'spessartite', NULL, 'Lamprophyre with more plagioclase than orthoclase, hornblende and diopsidic augite; may contain olivine.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1507);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299191, 'sannaite', NULL, 'Lamprophyre with more orthoclase than plagioclase, more feldspar than feldspathoid, brown amphibole, Ti-augite, olivine and biotite.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1506);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299192, 'diamictite', NULL, 'Unsorted or poorly sorted, non-calcareous, terriginous sedimentary rock with a wide range of particle sizes; cannot be assigned to any other class.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1376);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299193, 'melange', NULL, 'Body of rock lacking internal continuity of contacts or strata and including fragments and blocks of all sizes, both exotic and native, embedded in a fragmental matrix of finer-grained material.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1377);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299194, 'siltstone', NULL, 'Mudstone in which clasts are predominantly silt sized, ie. 0.004-0.032 mm diameter.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1374);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299195, 'calcilutite', NULL, 'Limestone consisting of more than 50 percent mud-sized carbonate grains.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1375);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299196, 'vogesite', NULL, 'Lamprophyre with more orthoclase than plagioclase, hornblende and diopsidic augite; may contain olivine.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1508);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299197, 'amphibolite', NULL, 'Gneissose or granofelsic rock consisting of green, brown or black amphibole and plagioclase (including albite), which combined constitute more than 75 percent of the rock; amphibole is more than 30 percent of rock and more than 50 percent of total mafics.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1509);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1679161121580275636, 'Geological Structure', 'GS', 'Geological Structure Concept Type', NULL, '2006-12-04 00:00:00', NULL, 1679161121580275194, 2);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299198, 'calc-silicate rock', NULL, 'Metamorphic rock consisting mainly of calcium-bearing silicates such as diopside and wollastonite; formed by metamorphism of impure limestone or dolomite.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1510);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299199, 'eclogite', NULL, 'Metamorphic rock composed of 75 percent or more (by volume) omphacite and garnet, both of which are present as major constituents, but the amount of neither of them being higher than 75 percent (by volume).  The presence of plagioclase precludes classification as an eclogite.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1511);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299200, 'granulite', NULL, 'High grade metamorphic rock containing feldspar and in which Fe-Mg silicates are dominantly hyrdoxyl-free.  The presence of primary muscovite precludes classification as a granulite.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1512);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299201, 'shale', NULL, 'Laminated, indurated rock with greater than 67 percent clay sized minerals.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1373);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299202, 'tuffaceous siltstone', NULL, 'Tuffite with average clast size 0.004-0.032 mm maximum diameter.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1436);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299203, 'tuffaceous sandstone', NULL, 'Tuffite with average clast size 0.032-2 mm maximum diameter.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1435);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299204, 'dolomite-mudstone', NULL, 'Carbonate rock composed of more than 75 percent mud-sized grains; main carbonate mineral is dolomite.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1382);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299205, 'lime-mudstone', NULL, 'Carbonate rock composed of more than 75 percent mud-sized grains; main carbonate mineral is calcite.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1381);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299206, 'tuffaceous mudstone', NULL, 'Tuffite with average clast size less than 0.004 mm maximum diameter.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1437);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299207, 'carbonate mudstone', NULL, 'Carbonate rock composed of more than 75 percent mud-sized grains.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1380);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299208, 'hornfels', NULL, 'Fine grained metamorphic rock composed of a mosaic of equidimensional grains; porphyroblasts or relict phenocrysts may be present in a characteristically granoblastic or decussate matrix; typically formed by contact metamorphism.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1514);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299209, 'mafic granulite', NULL, 'Granulite containing more than 30 percent mafic minerals.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1513);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299210, 'migmatite', NULL, 'Composite silicate metamorphic rock composed of darker and lighter parts, where the darker parts usually have features of metamorphic rocks, and the lighter parts are of igneous appearance; pervasively heterogeneous on a meso- to megascopic scale.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1516);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299211, 'marble', NULL, 'Metamorphic rock consisting predominantly of fine- to coarse-grained recrystallised calcite and/or dolomite; usually with a granoblastic, saccharoidal texture.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1515);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299212, 'phyllite', NULL, 'Fine to medium grained rock characterised by a lustrous sheen and a well-developed schistosity resulting from the alignment of phyllosilicates; usually of low metamorphic grade.', NULL, '2008-05-22 00:00:00', NULL, 1677736971447769071, 1517);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299213, 'marlstone', NULL, 'Impure limestone with up to 65 percent clay.', 'calcareous claystone', '2008-05-17 00:00:00', NULL, 1677736971447769071, 1379);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299214, 'tilloid', NULL, 'Conglomeratic mudstone varying from chaotic unsorted assemblages of coarse materials in mudstone matrix, to mudstone with sparsely distributed rounded clasts.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1378);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299215, 'tuffaceous breccia', NULL, 'Tuffite with average clast size greater than 2 mm maximum diameter; clasts are angular to highly angular.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1434);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299216, 'tuffaceous conglomerate', NULL, 'Tuffite with average clast size greater than 2 mm maximum diameter.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1433);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299217, 'leucosome', NULL, 'Light coloured compositional segregation, usually rich in quartz and feldspar, in a migmatite or other rock.', NULL, '2008-05-24 00:00:00', NULL, 1677736971447769076, 1555);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299218, 'megaclast', NULL, 'Large fragment in a sedimentary rock with a variably sized matrix.', NULL, '2008-05-24 00:00:00', NULL, 1677736971447769076, 1556);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (167916112856012861, 'earth flow', NULL, 'Downslope translation of soil and weathered rock over a discrete basal shear surface (landslide) within well-defined lateral boundaries; earth flow grades into mud flow with increasing fluidity.', 'earthflow;debris flow', '2007-11-15 00:00:00', NULL, 167916112856012594, 536);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736971447769447, 'rhodonite', 'Rdn', NULL, NULL, '2008-05-15 00:00:00', NULL, 1677736971447769075, 1222);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299098, 'siderite', 'Sid', NULL, NULL, '2008-05-17 00:00:00', NULL, 1677736972070299357, 1337);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299136, 'jasper', NULL, 'Red silica whose colour is due to the presence of hematite.', NULL, '2008-05-18 00:00:00', NULL, 1677736971447769071, 1414);
INSERT INTO classificationcode (id, name, abbreviation, description, synonyms, startdate, enddate, classificationscheme_id, sequencenumber) VALUES (1677736972070299154, 'bituminous coal', NULL, 'Black, hard and bright coal which typically breaks into rectangular lumps.', NULL, '2008-05-17 00:00:00', NULL, 1677736971447769071, 1400);
