INSERT INTO geologicalfeature (id, featuretype_id, identifier, descriptivename, textdescription, geologicalconcept_id, dataset_id, role_id) VALUES (16777549126942588, 28, NULL, NULL, 'Granite: equigranular, interlocking grains of quartz and rosettes of hydrothermal muscovite; feldspar replaced by masses of sericite and hematite; biotite by chlorite and sericite', 16777549126942585, 1, 1679161121580275464);
