INSERT INTO geologicalfeature (id, featuretype_id, identifier, descriptivename, textdescription, geologicalconcept_id, dataset_id, role_id) VALUES (167775491936281998, 28, NULL, 'contact aureole schist - cordierite zone', 'Cordierite schist, schistose cordierite hornfels and cordierite hornfels. Includes quartz-rich biotite schist and hornfels.', 16777549126932953, 1, 1679161121580275464);
INSERT INTO geologicalfeature (id, featuretype_id, identifier, descriptivename, textdescription, geologicalconcept_id, dataset_id, role_id) VALUES (167775491107838594, 28, NULL, 'Regional biotite zone', 'Slate, psammite, phyllite, fine-grained schist with biotite.', 1677754911513320507, 1, 1679161121580275464);
INSERT INTO geologicalfeature (id, featuretype_id, identifier, descriptivename, textdescription, geologicalconcept_id, dataset_id, role_id) VALUES (167775491107838781, 28, NULL, 'contact aureole hornfels', 'Interlayered black mudstone with minor siliceous siltstone and calcareous sandstone;  base is characterised by strong chlorite +/- stilpnomelane alteration. Unit contains a diverse range of Early Cambrian acritach fossils, and other fossils from within interbedded siliceous chert bands. Rock converted to hornfels in contact metamorphic aureole', 167775491107838706, 1, 1679161121580275464);
INSERT INTO geologicalfeature (id, featuretype_id, identifier, descriptivename, textdescription, geologicalconcept_id, dataset_id, role_id) VALUES (16777549126934759, 28, NULL, 'hornfels biotite zone', 'Biotite zone hornfels', 16777549126932953, 1, 1679161121580275464);
INSERT INTO geologicalfeature (id, featuretype_id, identifier, descriptivename, textdescription, geologicalconcept_id, dataset_id, role_id) VALUES (16777549126934769, 28, NULL, 'hornfels cordierite zone', 'Cordierite zone hornfels', 16777549126932953, 1, 1679161121580275464);
INSERT INTO geologicalfeature (id, featuretype_id, identifier, descriptivename, textdescription, geologicalconcept_id, dataset_id, role_id) VALUES (167775491107838810, 28, NULL, 'contact metamorphic hornfels', 'hornfels formed from Quartz-biotite-graphite schist, black, laminated: thin graded quartz and pelite layers are relict bedding; pelitic layers contain biotite; graphitic material. Black, greasy texture; disseminated pyrrhotite and pyrite mineralization; from a mix of Albion Formation and minor Magdala Volcanics precursors? nonmagnetic; contact metamorphic aureole rocks.', 1677754911513321191, 1, 1679161121580275464);
INSERT INTO geologicalfeature (id, featuretype_id, identifier, descriptivename, textdescription, geologicalconcept_id, dataset_id, role_id) VALUES (167775491107838814, 28, NULL, 'contact aureole hornfels', 'hornfels--spotted with cordierite', 1677754911513321305, 1, 1679161121580275464);
INSERT INTO geologicalfeature (id, featuretype_id, identifier, descriptivename, textdescription, geologicalconcept_id, dataset_id, role_id) VALUES (167775491107838881, 28, NULL, NULL, '750m of micaceous mudstone: red; with thin interbeds of yellowish quartzo-micaceous sandstone; laminated; rippled surfaces, mudcracks and bioturbation; poorly outcropping. Sparse fossil fauna of  ostracods, brachiopods, and fish spines, teeth and scales.', 1677754911513321305, 1, 1679161121580275464);
INSERT INTO geologicalfeature (id, featuretype_id, identifier, descriptivename, textdescription, geologicalconcept_id, dataset_id, role_id) VALUES (167775491107848330, 28, NULL, NULL, '150m of laminated mudstone, 30m of siliceous siltstone. Black shale, laminated siltstone: thinly bedded; thin sandstone beds; rare bioturbated mudstone; dark grey weathered to various pale colours', 167775491107848316, 1, 1679161121580275464);
